(1, 'Wannes Van Alboomfilip.van.alboom@pandora.be0476 938446Tienertweedaagse<p>Beste<br />\nWannes zou vanaf volgende week graag naar \\\'t Speelakkertje komen, eventueel samen met een vriend. Wat houdt de tienertweedaagse in? </p>\n<p>Groeten<br />\nIlse en Filip</p>\n178.22.146.215'),
(2, 'Anja De Volderanjadevolder@hotmail.com0475 710140uitstappen kleuters<p>Mijn dochtertje van 5, Eline Temmerman, zou volgende week van dinsdag tem vrijdag voor het eerst naar jullie speelpleinwerking komen. Ik zie dat jullie dinsdag / op haar eerste dag dus / een uitstap hebben gepland voor de kleutertjes naar de wereld van kina. Nemen jullie sowieso alle kleutertjes mee, of hoe gaat het vervoer daar naartoe, of hoe moet voor deze activiteiten ingeschreven worden?<br />\nGroetjes,<br />\nAnja</p>\n2109.134.53.18849Anja De Volder'),
(3, 'Ilse De Zutterilse.de.zutter@telenet.be0486 898656tienertweedaagse<p>Beste,<br />\nGraag zou ik Maite De Cock en Charlotte Beke inschrijven voor de tienertweedaagse. Is dit mailtje voldoende als bewijs?<br />\nIn de bijgevoegde brief is er sprake van een 2de brief maar die vind ik niet terug op de site.<br />\nBedankt alvast voor de respons en veel plezier!</p>\n<p>Mvg,<br />\nIlse De Zutter, mama van Maite</p>\n378.22.170.87'),
(4, 'melissa vandewielemelivandewiele@hotmail.com0497 484833speelplein<p>hallo,<br />\n tot wanneer is het speelplein? Welke datum? is deze week de laatste week? of volgende week? Op de vorige website stond het heel duidelijk bovenaan, nu vind ik de info niet meer terug....<br />\nmvg<br />\nmelissa vandewiele</p>\n481.247.52.106'),
(5, 'Lynn D\\&#039;hontdhontlynn@hotmail.com0471 048230Speelplein week 8 - 12 augustus<p>Beste,</p>\n<p>Ik heb zonet mijn dochtertje van 3 jaar, Emma de Hertogh, ingeschreven in jullie systeem. Ik kon hier niet direct een week selecteren, dus vroeg ik mij af of ik haar volgende week gewoon naar het speelplein kon brengen? Of gebeuren de inschrijvingen op datum toch vooraf?</p>\n<p>Alvast bedankt voor uw antwoord.</p>\n<p>Mvg<br />\nLynn D\\\'hont</p>\n591.180.239.11465Lynn D\'hont'),
