(16, 'Jasper Wellensjasper.wellens@gmail.com0485 131235Drumtomation op Glowmotion?<p>Beste leden van Speelplein \\\'t Speelakkertje,</p>\n<p>Ik vroeg mij af of jullie openstonden voor een nieuw concept voor Glowmotion op 16 september? Het concept van \\\"Drumtomation\\\" is wel apart; het is geen band, het is ook geen standaard DJ, maar het is wel een drummer op een elektronisch drumstel die de dj eigenlijk vervangt; zowel drums als mix als blacklight-show zullen live zijn. Meer info over het concept (alsook filmpjes, live audio, mixtapes, foto\\\'s, bio etc...) vind je op:</p>\n<p>http://vi.be/drumtomation<br />\nhttps://www.facebook.com/drumtomation<br />\nhttps://www.youtube.com/user/Jasperwellens/videos<br />\nhttps://www.mixcloud.com/drumtomation</p>\n<p>Ik heb gezien dat jullie voor het jeugdhuis bands zoeken (waarvoor ik mij via Vi.be alvast heb ingeschreven), maar misschien past mijn concept wel als overgang naar de DJ’s om 24u?<br />\nMisschien kan ik zo wel een set spelen tussen 23 en 24u?</p>\n<p>Hierbij alvast enkele filmpjes van op de OpeningsTD in de Vooruit in Gent van vorig jaar ;-)</p>\n<p>https://www.youtube.com/watch?v=IDFXLmjN5JQ<br />\nhttps://www.youtube.com/watch?v=n-SHRMrikB8<br />\nhttps://www.youtube.com/watch?v=fK1bMJqLQ9g</p>\n<p>Alvast bedankt voor jullie antwoord!</p>\n<p>Mvg,<br />\nJasper</p>\n16141.135.36.64'),
(17, 'Karin De Clercqbelldeclercq@telenet.be495 900875attest tussenkomst speelpleinwerking<p>Goede middag,</p>\n<p>Mijn beide zonen kwamen deze zomer bij jullie spelen, vullen jullie ook de attesten in voor tussenkomst van de CM. Zo ja hoe bezorg ik deze aan jullie?</p>\n<p>Mvg<br />\nKarin De Clercq</p>\n1791.183.43.41'),
(18, 'Ken Inghelsken@inghels.be0487 587956animatie halloween<p>Hoi,<br />\nals ouderraad van BS De Vogelzang in Oostakker zijn we op zoek naar enkele enthousiaste mensen om de animatie te verzorgen voor de kleuters tijdens onze jaarlijkse halloween party op vrijdag 28 oktober. Zijn er bij jullie kandidaten?<br />\nGroeten,<br />\nKen</p>\n1878.23.3.186'),
(19, 'Nele HenauNelehenau@hotmail.com495 543201Aanvraag tot terugbetaling CM <p>Beste,</p>\n<p>Graag had ik nog wat achterstallige formulieren bijgewerkt.<br />\nIs het nog mogelijk om bewijs van inschrijving te bekomen van 2015 voor Jules Eeckhout & Cyriel Eeckhout?<br />\n(In 2016 zijn ze slechts 1 dagje kunnen komen dus daarvoor is het de moeite niet om dit in te vullen)</p>\n<p>Stuur ik hiervoor best de formulieren \\\" aanvraag tot terugbetaling CM\\\" ter invulling per post op of hebben jullie deze formulieren zelf voorhanden?</p>\n<p>Laat maar weten wat voor jou de handigste manier is!</p>\n<p>Met vriendelijke groeten,<br />\nNele Henau</p>\n1978.22.131.167'),
(20, 'Sara Temmermansaratemmerman@hotmail.com0498 137268activiteiten deze zomer<p>Goede middag.</p>\n<p>we zouden onze zoon en dochter graag inschrijven voor \\\'t speelakkertje deze zomer.<br />\nOnze zoon wordt wel pas 3 vanaf 24/7/2017. Kan dit voor hem pas vanaf dan of al mee vanaf start activiteiten / zomer?<br />\nWanneer zullen de activiteiten voor 2017 precies doorgaan. Klopt 10/7 tot 11/8?</p>\n<p>Bedankt voor feedback.</p>\n2080.15.83.98'),
