(11, 1, '4', '<p>Mijn dochtertje van 5, Eline Temmerman, zou volgende week van dinsdag tem vrijdag voor het eerst naar jullie speelpleinwerking komen. Ik zie dat jullie dinsdag / op haar eerste dag dus / een uitstap hebben gepland voor de kleutertjes naar de wereld van kina. Nemen jullie sowieso alle kleutertjes mee, of hoe gaat het vervoer daar naartoe, of hoe moet voor deze activiteiten ingeschreven worden?<br />\nGroetjes,<br />\nAnja</p>\n', 2, '2016-07-29 18:18:09', '109.134.53.188', 49),
