(94, 1, '3', 'Drumtomation op Glowmotion?', 16, '2016-08-18 18:23:40', '141.135.36.64', 0),
(95, 1, '4', '<p>Beste leden van Speelplein \'t Speelakkertje,</p>\n<p>Ik vroeg mij af of jullie openstonden voor een nieuw concept voor Glowmotion op 16 september? Het concept van \"Drumtomation\" is wel apart; het is geen band, het is ook geen standaard DJ, maar het is wel een drummer op een elektronisch drumstel die de dj eigenlijk vervangt; zowel drums als mix als blacklight-show zullen live zijn. Meer info over het concept (alsook filmpjes, live audio, mixtapes, foto\'s, bio etc...) vind je op:</p>\n<p>http://vi.be/drumtomation<br />\nhttps://www.facebook.com/drumtomation<br />\nhttps://www.youtube.com/user/Jasperwellens/videos<br />\nhttps://www.mixcloud.com/drumtomation</p>\n<p>Ik heb gezien dat jullie voor het jeugdhuis bands zoeken (waarvoor ik mij via Vi.be alvast heb ingeschreven), maar misschien past mijn concept wel als overgang naar de DJ’s om 24u?<br />\nMisschien kan ik zo wel een set spelen tussen 23 en 24u?</p>\n<p>Hierbij alvast enkele filmpjes van op de OpeningsTD in de Vooruit in Gent van vorig jaar ;-)</p>\n<p>https://www.youtube.com/watch?v=IDFXLmjN5JQ<br />\nhttps://www.youtube.com/watch?v=n-SHRMrikB8<br />\nhttps://www.youtube.com/watch?v=fK1bMJqLQ9g</p>\n<p>Alvast bedankt voor jullie antwoord!</p>\n<p>Mvg,<br />\nJasper</p>\n', 16, '2016-08-18 18:23:40', '141.135.36.64', 0),
