(107, 1, '4', '<p>Hoi,<br />\nals ouderraad van BS De Vogelzang in Oostakker zijn we op zoek naar enkele enthousiaste mensen om de animatie te verzorgen voor de kleuters tijdens onze jaarlijkse halloween party op vrijdag 28 oktober. Zijn er bij jullie kandidaten?<br />\nGroeten,<br />\nKen</p>\n', 18, '2016-10-03 17:32:30', '78.23.3.186', 0),
