(113, 1, '4', '<p>Beste,</p>\n<p>Graag had ik nog wat achterstallige formulieren bijgewerkt.<br />\nIs het nog mogelijk om bewijs van inschrijving te bekomen van 2015 voor Jules Eeckhout & Cyriel Eeckhout?<br />\n(In 2016 zijn ze slechts 1 dagje kunnen komen dus daarvoor is het de moeite niet om dit in te vullen)</p>\n<p>Stuur ik hiervoor best de formulieren \" aanvraag tot terugbetaling CM\" ter invulling per post op of hebben jullie deze formulieren zelf voorhanden?</p>\n<p>Laat maar weten wat voor jou de handigste manier is!</p>\n<p>Met vriendelijke groeten,<br />\nNele Henau</p>\n', 19, '2016-11-21 08:36:54', '78.22.131.167', 0),
