(185, 1, '4', '<p>Beste,<br />\nbij het wijzigen van de gegeven is er een fout gebeurd; ik wou mijn kinderen aanmelden dat ze dit jaar zouden komen. Als ik echter op \"wijzig mijn gegevens\" klik kom ik opnieuw in een formulier om en moet ik alle gegevens er terug insteken.<br />\nBijgevolg dat mij beide kinderen er nun 2x in zitten; eenmaal aangeduid dat ze niet komen en andermaal dat ze wel komen...</p>\n<p>Wou deze fout in het systeem toch even meleden.</p>\n', 31, '2017-01-16 06:58:26', '212.123.26.50', 84),
(186, 1, 'verifyInfo@2', 'b90fb4f4f61a3898f1b40eb1f6f238b1**1**2', 31, '2017-01-16 06:58:26', '212.123.26.50', 84);
INSERT INTO `wp_formmaker_themes` (`id`, `title`, `css`, `default`) VALUES
(1, 'Theme 01 blue', '/*---------------------------------------\n2.7 FORM ELEMENTS\n-----------------------------------------*/\nbutton,\ninput[type=\"button\"],\ninput[type=\"reset\"],\ninput[type=\"submit\"] {\n     background-image: url(images/tr-btn.png);\n     background-repeat: repeat-x;\n     background-color: #f16c20;\n     background-size: contain;\n     text-shadow: none;\n     border: none;\n     -webkit-border-radius: 3px;\n     -moz-border-radius: 3px;\n     border-radius: 3px;\n     text-transform: uppercase;\n     letter-spacing: 1px;\n     font-size: 12px;\n     line-height: 1.6;\n     border: none;\n     padding: 10px 30px 10px 30px;\n     color: #ffffff;\n     -webkit-transition: none;\n     transition: none;\n     font-weight: bold;\n}\nbutton:hover,\ninput[type=\"button\"]:hover,\ninput[type=\"reset\"]:hover,\ninput[type=\"submit\"]:hover {\n     background: #f16c20;\n     border-color: inherit;\n}\nbutton:focus,\ninput[type=\"button\"]:focus,\ninput[type=\"reset\"]:focus,\ninput[type=\"submit\"]:focus,\nbutton:active,\ninput[type=\"button\"]:active,\ninput[type=\"reset\"]:active,\ninput[type=\"submit\"]:active {\n     border-color: #aaa #bbb #bbb;\n     box-shadow: inset 0 -1px 0 rgba(255, 255, 255, 0.5), inset 0 2px 5px rgba(0, 0, 0, 0.15);\n}\ninput[type=\"text\"],\ninput[type=\"email\"],\ninput[type=\"url\"],\ninput[type=\"password\"],\ninput[type=\"search\"],\ninput[type=\"tel\"],\ninput[type=\"time\"],\ninput[type=\"week\"],\ninput[type=\"month\"],\ninput[type=\"datetime-local\"],\ninput[type=\"datetime\"],\ninput[type=\"date\"],\ninput[type=\"color\"],\ntextarea,\nselect {\n     color: #666;\n     border: 1px solid #dedede;\n     -webkit-border-radius: 3px;\n     -moz-border-radius: 3px;\n     border-radius: 3px;\n     padding: 5px;\n}\ninput[type=\"text\"]:focus,\ninput[type=\"email\"]:focus,\ninput[type=\"url\"]:focus,\ninput[type=\"password\"]:focus,\ninput[type=\"search\"]:focus,\ntextarea:focus {\n     color: #111;\n}\ntextarea {\n     width: 100%;\n     height: auto;\n     min-height: 150px;\n     padding: 10px;\n}\n.input-box,\n.textarea-box {\n     margin-bottom: 15px;\n     outline: 0;\n     border: 0;\n     -webkit-box-shadow: none;\n     box-shadow: none;\n     border: 1px solid #dedede;\n     -webkit-border-radius: 3px;\n     -moz-border-radius: 3px;\n     border-radius: 3px;\n     color: #999999;\n     line-height: auto;\n}\n.input-box {\n     min-height: 45px;\n}\n.textarea-box {\n     padding-top: 5px;\n     padding-bottom: 5px;\n}\ntextarea.form-control {\n     min-height: 100px;\n}\n.input-box:active,\n.textarea-box:active,\n.input-box:focus,\n.textarea-box:focus {\n     color: #272727;\n     -webkit-box-shadow: none;\n     box-shadow: none;\n}\ninput[type=\"date\"], input[type=\"time\"], input[type=\"datetime-local\"], input[type=\"month\"]{\n     line-height: normal;\n}\nlabel{\n     vertical-align: middle;\n     padding-right: 5px;\n}\n', 0),
