\",\"image_url\":\"http:\\/\\/speelakkertje.be\\/wp-content\\/themes\\/llorix-one-lite\\/images\\/team\\/2.jpg\",\"title\":\"Tonya Garcia\",\"subtitle\":\"Account Manager\",\"id\":\"\",\"shortcode\":\"undefined\"},{\"text\":\"undefined\",\"image_url\":\"http:\\/\\/speelakkertje.be\\/wp-content\\/themes\\/llorix-one-lite\\/images\\/team\\/3.jpg\",\"title\":\"Linda Guthrie\",\"subtitle\":\"Business Development\",\"id\":\"\",\"shortcode\":\"undefined\"}]\";s:36:\"llorix_one_lite_testimonials_content\";s:1714:\"[{\"text\":\"Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nulla nec purus feugiat, molestie ipsum et, consequat nibh. Etiam non elit dui. Nullam vel eros sit amet arcu vestibulum accumsan in in leo. Fusce malesuada vulputate faucibus. Integer in hendrerit nisi. Praesent a hendrerit urna. In non imperdiet elit, sed molestie odio. Fusce ac metus non purus sollicitudin laoreet.\",\"image_url\":\"http:\\/\\/speelakkertje.be\\/wp-content\\/themes\\/llorix-one-lite\\/images\\/clients\\/1.jpg\",\"title\":\"Happy Customer\",\"subtitle\":\"Lorem ipsum\",\"id\":\"\",\"shortcode\":\"undefined\"},{\"text\":\"Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nulla nec purus feugiat, molestie ipsum et, consequat nibh. Etiam non elit dui. Nullam vel eros sit amet arcu vestibulum accumsan in in leo. Fusce malesuada vulputate faucibus. Integer in hendrerit nisi. Praesent a hendrerit urna. In non imperdiet elit, sed molestie odio. Fusce ac metus non purus sollicitudin laoreet.\",\"image_url\":\"http:\\/\\/speelakkertje.be\\/wp-content\\/themes\\/llorix-one-lite\\/images\\/clients\\/2.jpg\",\"title\":\"Happy Customer\",\"subtitle\":\"Lorem ipsum\",\"id\":\"\",\"shortcode\":\"undefined\"},{\"text\":\"Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nulla nec purus feugiat, molestie ipsum et, consequat nibh. Etiam non elit dui. Nullam vel eros sit amet arcu vestibulum accumsan in in leo. Fusce malesuada vulputate faucibus. Integer in hendrerit nisi. Praesent a hendrerit urna. In non imperdiet elit, sed molestie odio. Fusce ac metus non purus sollicitudin laoreet.\",\"image_url\":\"http:\\/\\/speelakkertje.be\\/wp-content\\/themes\\/llorix-one-lite\\/images\\/clients\\/3.jpg\",\"title\":\"Happy Customer\",\"subtitle\":\"Lorem ipsum\",\"id\":\"\",\"shortcode\":\"undefined\"}]\";s:26:\"llorix_one_lite_logos_show\";s:1:\"1\";s:30:\"llorix_one_lite_our_story_text\";s:895:\"\nIntroductie\n<p>\nTijdens de zomervakantie stellen wij onze deuren wagenwijd open voor alle kinderen van <strong>3 tot en met 15 jaar</strong>! Met een enthousiaste groep van ongeveer veertig animatoren staan wij al 20 jaar in voor ongelooflijk veel speelplezier aan de rand van <strong>Oostakker</strong>.</p>\n\n<p>Deze zomer zijn we er weer van <strong>10 juli t.e.m. 11 augustus 2017</strong>. Dagelijks kunnen kinderen nog echt ravotten, nat en vuil worden waarna ze \'s avonds tevreden en moe terug naar huis kunnen gaan. Dit allemaal wordt (mogelijk gemaakt) door al onze vrijwillige begeleiders.</p>\n\n<p>Mocht u of uw kind nog twijfelen, of vragen hebben, twijfel dan zeker niet om eens binnen te springen, of neem gewoon contact op. We zijn er zeker van dat de komende zomermaanden vanaf nu een aangename belevenis kunnen betekenen en een verrijking voor de leeromgeving van elk kind.\n</p>\n\";s:31:\"llorix_one_lite_our_story_image\";s:66:\"http://speelakkertje.be/wp-content/uploads/2016/07/leeuw_blauw.png\";s:33:\"llorix_one_lite_ribbon_background\";s:63:\"http://speelakkertje.be/wp-content/uploads/2016/09/IMG_5541.jpg\";s:28:\"llorix_one_lite_ribbon_title\";s:44:\"Alle kinderen beleven dagelijks plezier door\";s:27:\"llorix_one_lite_button_text\";s:21:\"Onze zotte animatoren\";s:27:\"llorix_one_lite_button_link\";s:35:\"http://speelakkertje.be/wie-is-wie/\";s:33:\"llorix_one_lite_our_services_show\";s:1:\"1\";s:29:\"llorix_one_lite_our_team_show\";s:1:\"1\";s:36:\"llorix_one_lite_happy_customers_show\";s:1:\"1\";s:25:\"llorix_one_lite_copyright\";s:0: