(23657, '_transient_dash_12fb51b99c5dfec05835445e04f970a4', '<div class=\"rss-widget\"><ul><li><a class=\'rsswidget\' href=\'https://wordpress.org/news/2017/01/wordpress-4-7-2-security-release/\'>WordPress 4.7.2 Security Release</a> <span class=\"rss-date\">26 januari 2017</span><div class=\"rssSummary\">WordPress 4.7.2 is now available. This is a security release for all previous versions and we strongly encourage you to update your sites immediately. WordPress versions 4.7.1 and earlier are affected by three security issues: The user interface for assigning taxonomy terms in Press This is shown to users who do not have permissions to use it. [&hellip;]</div></li></ul></div><div class=\"rss-widget\"><ul><li><a class=\'rsswidget\' href=\'https://nl.wordpress.org/2017/02/08/wordcamp-nijmegen-zoekt-organisatoren/\'>WordCamp Nijmegen zoekt organisatoren!</a></li><li><a class=\'rsswidget\' href=\'https://nl.wordpress.org/2016/12/06/wordpress-4-7-is-vrijgegeven/\'>WordPress 4.7 is vrijgegeven</a></li><li><a class=\'rsswidget\' href=\'https://nl.wordpress.org/2016/10/26/doe-met-ons-mee-op-global-wordpress-translation-day/\'>Doe met ons mee op Global WordPress Translation Day!</a></li></ul></div><div class=\"rss-widget\"><ul><li class=\"dashboard-news-plugin\"><span>Populaire plugin:</span> iThemes Security (formerly Better WP Security)&nbsp;<a href=\"plugin-install.php?tab=plugin-information&amp;plugin=updraftplus&amp;_wpnonce=c358b44a84&amp;TB_iframe=true&amp;width=600&amp;height=800\" class=\"thickbox open-plugin-details-modal\" aria-label=\"iThemes Security (formerly Better WP Security) installeren\">(Installeren)</a></li></ul></div>', 'no'),
