(79, 1, '2016-07-23 17:15:25', '2016-07-23 15:15:25', '<h2>De animatorenploeg</h2>\r\n<img class=\" wp-image-394 alignleft\" src=\"http://beta.speelakkertje.be/wordpress/wp-content/uploads/2016/07/11825590_956675897712723_5879088722999608773_n-300x202.jpg\" alt=\"11825590_956675897712723_5879088722999608773_n\" width=\"384\" height=\"259\" />De animatorenploeg bestaat uit een groep <strong>enthousiaste vrijwilligers</strong> die elke zomer het beste van zichzelf geven.  Enkele kenmerken van een animator zijn: enorm veel fantasie hebben, sociaal zijn, graag met kinderen omgaan, met wat verkleedkleren aan is hij/zij iemand compleet <a id=\"_GPLITA_0\" style=\"background-color: transparent !important; border: none !important; text-indent: 0px !important; float: none !important; font-weight: bold !important; height: auto !important; margin: 0px !important; min-height: 0px !important; min-width: 0px !important; padding: 0px !important; text-decoration: underline !important; vertical-align: baseline !important; width: auto !important;\" title=\"Click to Continue &gt; by Deal Top\" href=\"#\">anders</a>, en nog zoveel meer!\r\n\r\nMaandelijks organiseert de staf animatorenactiviteiten om elkaar beter te leren kennen of om warm te worden voor de naderende zomervakantie!\r\n\r\nWil je graag kennismaken met onze animatorenploeg?  Neem dan zeker contact op met ons via <span style=\"text-decoration: underline;\">speelakkertje@hotmail.com</span> en wij helpen jou graag met verdere informatie!\r\n\r\nIedereen is welkom!\r\n\r\nMeer <a id=\"_GPLITA_1\" style=\"background-color: transparent !important; border: none !important; text-indent: 0px !important; float: none !important; font-weight: bold !important; height: auto !important; margin: 0px !important; min-height: 0px !important; min-width: 0px !important; padding: 0px !important; text-decoration: underline !important; vertical-align: baseline !important; width: auto !important;\" title=\"Click to Continue &gt; by Deal Top\" href=\"#\">info</a> kan je vinden in onze <a href=\"../../../wp-content/uploads/2011/02/Infobrochure.pdf\">Infobrochure</a> voor nieuwe animatoren of in onze <a href=\"../../../wp-content/uploads/2011/02/Animatorenbundel.pdf\">Animatorenbundel</a>. ( Je vindt deze terug onder \'documenten\' -&gt; <a id=\"_GPLITA_2\" style=\"background-color: transparent !important; border: none !important; text-indent: 0px !important; float: none !important; font-weight: bold !important; height: auto !important; margin: 0px !important; min-height: 0px !important; min-width: 0px !important; padding: 0px !important; text-decoration: underline !important; vertical-align: baseline !important; width: auto !important;\" title=\"Click to Continue &gt; by Deal Top\" href=\"#\">\'Extra\'s\'</a> )\r\n<h2>Vorming</h2>\r\n<img class=\" wp-image-395 alignright\" src=\"http://beta.speelakkertje.be/wordpress/wp-content/uploads/2016/07/13659147_1159067884140189_1302353590442901342_n-300x200.jpg\" alt=\"13659147_1159067884140189_1302353590442901342_n\" width=\"309\" height=\"206\" />We stimuleren elke animator om op cursus te gaan en dit bij voorkeur met de <a href=\"http://jeugd.gent.be/eCache/JON/1/136.html\">Vlaamse Dienst Speelpleinwerk</a> (VDS).\r\nElke animatorcursus wordt door de Jeugddienst van de Stad Gent gedeeltelijk terugbetaald via het <a id=\"_GPLITA_3\" style=\"background-color: transparent !important; border: none !important; text-indent: 0px !important; float: none !important; font-weight: bold !important; height: auto !important; margin: 0px !important; min-height: 0px !important; min-width: 0px !important; padding: 0px !important; text-decoration: underline !important; vertical-align: baseline !important; width: auto !important;\" title=\"Click to Continue &gt; by Deal Top\" href=\"#\">document</a> dat je <a href=\"http://www.jeugd.gent.be/eCache/JON/1/705.html\" target=\"_blank\">hier</a> vindt.  Heb je bovendien de cursus gevolgd bij VDS en slaag je voor een stage van twee weken op onze werking dan betalen wij het resterende bedrag terug!\r\n\r\nDit alles geldt ook voor hoofdanimatoren in wording!', 'Animator worden', '', 'publish', 'closed', 'closed', '', 'animator-worden', '', '', '2016-07-23 17:15:25', '2016-07-23 15:15:25', '', 0, 'http://speelakkertje.be/?page_id=79', 0, 'page', '', 0),
