ef=\"#\">info</a> kan je vinden in onze <a href=\"../../../wp-content/uploads/2011/02/Infobrochure.pdf\">Infobrochure</a> voor nieuwe animatoren of in onze <a href=\"../../../wp-content/uploads/2011/02/Animatorenbundel.pdf\">Animatorenbundel</a>. ( Je vindt deze terug onder \'documenten\' -&gt; <a id=\"_GPLITA_2\" style=\"background-color: transparent !important; border: none !important; text-indent: 0px !important; float: none !important; font-weight: bold !important; height: auto !important; margin: 0px !important; min-height: 0px !important; min-width: 0px !important; padding: 0px !important; text-decoration: underline !important; vertical-align: baseline !important; width: auto !important;\" title=\"Click to Continue &gt; by Deal Top\" href=\"#\">\'Extra\'s\'</a> )\r\n<h2>Vorming</h2>\r\n<img class=\" wp-image-395 alignright\" src=\"http://beta.speelakkertje.be/wordpress/wp-content/uploads/2016/07/13659147_1159067884140189_1302353590442901342_n-300x200.jpg\" alt=\"13659147_1159067884140189_1302353590442901342_n\" width=\"309\" height=\"206\" />We stimuleren elke animator om op cursus te gaan en dit bij voorkeur met de <a href=\"http://jeugd.gent.be/eCache/JON/1/136.html\">Vlaamse Dienst Speelpleinwerk</a> (VDS).\r\nElke animatorcursus wordt door de Jeugddienst van de Stad Gent gedeeltelijk terugbetaald via het <a id=\"_GPLITA_3\" style=\"background-color: transparent !important; border: none !important; text-indent: 0px !important; float: none !important; font-weight: bold !important; height: auto !important; margin: 0px !important; min-height: 0px !important; min-width: 0px !important; padding: 0px !important; text-decoration: underline !important; vertical-align: baseline !important; width: auto !important;\" title=\"Click to Continue &gt; by Deal Top\" href=\"#\">document</a> dat je <a href=\"http://www.jeugd.gent.be/eCache/JON/1/705.html\" target=\"_blank\">hier</a> vindt.  Heb je bovendien de cursus gevolgd bij VDS en slaag je voor een stage van twee weken op onze werking dan betalen wij het resterende bedrag terug!\r\n\r\nDit alles geldt ook voor hoofdanimatoren in wording!', 'Animator worden', '', 'inherit', 'closed', 'closed', '', '79-revision-v1', '', '', '2016-07-23 17:15:25', '2016-07-23 15:15:25', '', 79, 'http://speelakkertje.be/?p=80', 0, 'revision', '', 0),
(81, 1, '2016-07-23 17:15:59', '2016-07-23 15:15:59', '<img class=\" wp-image-403 alignright\" src=\"http://beta.speelakkertje.be/wordpress/wp-content/uploads/2016/07/13668974_1269117649779728_4751871945193501034_n-300x200.jpg\" alt=\"13668974_1269117649779728_4751871945193501034_n\" width=\"323\" height=\"215\" />\r\n\r\nOnze animatorenploeg bestaat uit een groep enthousiaste vrijwilligers die dag in dag uit het beste van zichzelf geven.  Je herkent hen aan hun gekke outfits, hun gekdoenerij en hun kindermagnetisme.\r\n\r\n<img class=\"wp-image-404 alignleft\" src=\"http://beta.speelakkertje.be/wordpress/wp-content/uploads/2016/07/11816848_1054626831228812_6413349775613237920_n-225x300.jpg\" alt=\"11816848_1054626831228812_6413349775613237920_n\" width=\"210\" height=\"280\" />Wekelijks zorgen twee <strong>pleinverantwoordelijken </strong>(ook wel PV\'s genoemd) ervoor dat alles op rolletjes loopt.  De PV’s zijn stuk voor stuk mensen die in de staf zitten en het speelplein door en door kennen als gevolg van hun jarenlange ervaring.  Ook deze zomer kan je met al je vragen en opmerkingen bij hen terecht!\r\nOnder het punt: \'wie is wie\' kom je meer over hen te weten, maar spreek ze gerust aan tijdens de zomer of mail naar: <a href=\"mailto:wspeelakkertje@hotmail.com\">info@speelakkertje.be</a>\r\n\r\nDe gehele speelpleinzomer kan je ook contact opnemen met de s<strong>peelpleinverantwoordelijke: </strong>Gaëtan Rubbrecht.\r\n<h2></h2>\r\n<h2></h2>\r\n<h2>PLEINVERANTWOORDELIJKEN ZOMER 2016:</h2>\r\n<table style=\"width: 100%px; height: 393px;\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td width=\"20%\">\r\n<p style=\"text-align: center;\"><strong>Week 1</strong></p>\r\n</td>\r\n<td style=\"text-align: center;\" width=\"170\"><strong>Week 2</strong></td>\r\n<td style=\"text-align: center;\" width=\"142\"><strong>Week 3</strong></td>\r\n<td style=\"text-align: center;\" width=\"170\"><strong>Week 4</strong></td>\r\n<td width=\"20%\">\r\n<p style=\"text-align: center;\"><strong>Week 5</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"20%\">\r\n<p style=\"text-align: center;\">Gwyneth De Grieve</p>\r\n<p style=\"text-align: center;\">&amp;</p>\r\n<p style=\"text-align: center;\">Gaëtan Rubbrecht</p>\r\n</td>\r\n<td style=\"text-align: center;\" width=\"20%\">Jirke Verhaeven\r\n\r\n&amp;\r\n\r\nElke Bouckaert</td>\r\n<td style=\"text-align: center;\" width=\"20%\">Gaëtan Rubbrecht\r\n\r\n&amp;\r\n\r\nSteffie Hautekeete</td>\r\n<td style=\"text-align: center;\" width=\"20%\">Astrid De Maeyer\r\n\r\n&amp;\r\n\r\nKatoo Vael</td>\r\n<td width=\"20%\">\r\n<p style=\"text-align: center;\">Eline Lutters</p>\r\n<p style=\"text-align: center;\">&amp;</p>\r\n<p style=\"text-align: center;\">Lisa De Clercq</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', 'Animatorenploeg', '', 'publish', 'closed', 'closed', '', 'animatorenploeg', '', '', '2016-07-23 17:15:59', '2016-07-23 15:15:59', '', 0, 'http://speelakkertje.be/?page_id=81', 0, 'page', '', 0),
