(83, 1, '2016-07-23 17:17:13', '2016-07-23 15:17:13', '<div id=\"left_column1\" style=\"width: 35%; float: left;\">\r\n<div class=\"left_details\">\r\n<h1><strong>\'t Speelakkertje vzw</strong></h1>\r\n<strong>Telefoon:</strong> 0477 47 52 09\r\n<span class=\"italic\">(enkel bereikbaar tijdens de zomermaanden)</span>\r\n\r\n<strong>Bij dringende gevallen en na 19h:</strong>\r\n<span class=\"contact_detail\">0484 94 69 95</span>\r\n\r\n<span class=\"italic\">(Gaëtan Rubbrecht)</span>\r\n\r\n<strong>Email:</strong>\r\ninfo@speelakkertje.be\r\n\r\n<hr class=\"clear\" />\r\n\r\n<strong>Speelterrein:</strong>\r\nEDUGO campus De Toren,\r\nSint-Jozefstraat 10\r\n9041 Oostakker\r\n\r\n<strong>Secretariaatsadres:</strong>\r\nSpeelplein \'t Speelakkertje vzw\r\nGalgenberglaan 23\r\n9070 Destelbergen\r\n\r\n<iframe src=\"http://www.facebook.com/plugins/likebox.php?href=http%3A%2F%2Fwww.facebook.com%2Fpages%2FSpeelplein-t-Speelakkertje-Oostakker%2F191609287530575&amp;width=292&amp;colorscheme=light&amp;show_faces=false&amp;border_color&amp;stream=false&amp;header=true&amp;height=62\" width=\"300\" height=\"150\" frameborder=\"0\" scrolling=\"no\"></iframe>\r\n\r\n</div>\r\n</div>\r\n<div id=\"left_column1\" style=\"float: right; width: 50%;\">\r\n<h1>Contacteer ons</h1>\r\nZit je met vragen die niet dringend zijn, neem dan gerust contact met ons op met onderstaand formulier!\r\n\r\n[Form id=\"1\"]\r\n\r\n</div>', 'Contact', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2016-07-23 17:17:13', '2016-07-23 15:17:13', '', 2, 'http://speelakkertje.be/?p=83', 0, 'revision', '', 0),
(84, 1, '2016-07-23 17:17:35', '2016-07-23 15:17:35', 'De staf bestaat uit een groepje meer ervaren animatoren die het plein draaiende houdt.  Ze komen maandelijks samen tijdens een stafvergadering om alles te bespreken dat te maken heeft met het speelplein (beslissen over de centen, organiseren van animatorenactiviteiten, aanvragen van subsidies, verzorgen van de PR van het speelplein en zo zorgen dat er kindjes en animatoren zijn, …)  Elk van hen trekt daarnaast een of meerdere werkgroepen, waar je als animator aan kan deelnemen en zo je eigen stempel op de werking kan drukken!\r\n\r\nStaflid kan je worden vanaf het jaar dat je achttien wordt en je moet minstens één zomer als animator actief geweest zijn op het speelplein.\r\n\r\nDe huidige staf kent de volgende samenstelling:\r\n\r\n<img class=\" wp-image-614 alignright\" src=\"http://speelakkertje.be/wp-content/uploads/2016/07/IMG_0425_2-300x200.jpg\" alt=\"img_0425_2\" width=\"384\" height=\"256\" />\r\n<ul>\r\n 	<li>Gaëtan Rubbrecht (Voorzitter)</li>\r\n 	<li>Katoo Vael (Vice-Voorzitter)</li>\r\n 	<li>Jeroen Dellaert (ICT verantwoordelijke)</li>\r\n 	<li>Gwyneth De Grieve</li>\r\n 	<li>Imke Goetschalckx</li>\r\n 	<li>Gwen De Meulemeester</li>\r\n 	<li>Nathan Steyaert</li>\r\n 	<li>Axel Caspeele</li>\r\n 	<li>Steffie Hautekeete</li>\r\n</ul>', 'De staf', '', 'publish', 'closed', 'closed', '', 'de-staf', '', '', '2016-10-01 18:10:37', '2016-10-01 16:10:37', '', 0, 'http://speelakkertje.be/?page_id=84', 0, 'page', '', 0),
(85, 1, '2016-07-23 17:17:35', '2016-07-23 15:17:35', 'De staf bestaat uit een groepje meer ervaren animatoren die het plein draaiende houdt.  Ze komen maandelijks samen tijdens een stafvergadering om alles te bespreken dat te maken heeft met het speelplein (beslissen over de centen, organiseren van animatorenactiviteiten, aanvragen van subsidies, verzorgen van de PR van het speelplein en zo zorgen dat er kindjes en animatoren zijn, …)  Elk van hen trekt daarnaast een of meerdere werkgroepen, waar je als animator aan kan deelnemen en zo je eigen stempel op de werking kan drukken!\r\n\r\nStaflid kan je worden vanaf het jaar dat je achttien wordt en je moet minstens één zomer als animator actief geweest zijn op het speelplein.\r\n\r\nDe huidige staf kent de volgende samenstelling:\r\n<ul>\r\n 	<li>Gaëtan Rubbrecht (voorzitter)</li>\r\n 	<li>Lisa De Clercq (ondervoorzitter)</li>\r\n 	<li>Astrid De Maeyer</li>\r\n 	<li>Marie Gekiere</li>\r\n 	<li>Eline Lutters</li>\r\n 	<li>Jirke Verhaeven</li>\r\n 	<li>Katoo Vael</li>\r\n 	<li>Elke Bouckaert</li>\r\n 	<li>Gwyneth De Grieve</li>\r\n</ul>', 'De staf', '', 'inherit', 'closed', 'closed', '', '84-revision-v1', '', '', '2016-07-23 17:17:35', '2016-07-23 15:17:35', '', 84, 'http://speelakkertje.be/?p=85', 0, 'revision', '', 0),
(86, 1, '2016-07-23 17:18:24', '2016-07-23 15:18:24', '<ul>\r\n 	<li>Algemeen\r\n<ul>\r\n 	<li>[download-attachment id=\"492\" title=\"Inschrijvingsfiche 2016\"]</li>\r\n</ul>\r\n</li>\r\n 	<li>Middengroep en tieners\r\n<ul>\r\n 	<li>[download-attachment id=\"504\" title=\"Algemene brief middengroep en tieners uitstappen\"]</li>\r\n 	<li>[download-attachment id=\"505\" title=\"Brief tienerfuif\"]</li>\r\n 	<li>[download-attachment id=\"507\" title=\"Brief tweedaagse tieners voor tieners\"]</li>\r\n 	<li>[download-attachment id=\"509\" title=\"brief week 1, 6 - 14 jaar (11 - 15 juli)\"]</li>\r\n 	<li>[download-attachment id=\"510\" title=\"Brief week 2, 6 - 14 jaar (18 - 22 juli)\"]</li>\r\n 	<li>[download-attachment id=\"511\" title=\"Brief week 3, 6 - 14 jaar (25 - 29 juli)\"]</li>\r\n 	<li>[download-attachment id=\"512\" title=\"Brief week 4, 6 - 14 jaar (1 - 5 augustus)\"]</li>\r\n 	<li>[download-attachment id=\"513\" title=\"Brief week 5, 6 - 14 jaar(8 - 12 augustus)\"]</li>\r\n</ul>\r\n</li>\r\n 	<li>Kleutertjes\r\n<ul>\r\n 	<li>[download-attachment id=\"575\" title=\"Kleuterbrief zomer 2016 \"]</li>\r\n 	<li>[download-attachment id=\"574\" title=\"Brief Kina 2016  (1-5 augustus)\"]</li>\r\n</ul>\r\n</li>\r\n</ul>', 'Documenten', '', 'publish', 'closed', 'closed', '', 'documenten', '', '', '2016-08-01 11:34:32', '2016-08-01 09:34:32', '', 0, 'http://speelakkertje.be/?page_id=86', 0, 'page', '', 0),
