(88, 1, '2016-07-23 17:18:48', '2016-07-23 15:18:48', 'Iedere dag op het speelplein is anders door de verschillende activiteiten waar je aan kan deelnemen maar een speelpleindag heeft wel een bepaalde structuur.\r\n\r\nElke speelpleindag begint met de inschrijvingen. Je kan kiezen voor een volle dag of een halve dag speelplezier.\r\nVoor een volle dag betaal je €7. Bij deze optie moet je kind eigen lunchpakket meenemen. <span style=\"text-decoration: underline;\">Vanaf de zomer van 2016 is het wel mogelijk om op vrijdagmiddag hot dogs te krijgen. Voor €1 kan je kind dan zoveel hot dogs eten als hij/zij wil om hun buikje te vullen.</span> Voor een halve dag betaal je €3. In dit bedrag is inbegrepen: een koekje en drankje om 10.00u en/of 15.00u, verzekering en een fantastische speel(namid)dag!\r\n\r\n<em>Kinderen die voor het eerst deze zomer komen, vullen hun gegevens in op een inschrijvingsfiche.  De volgende dag zitten ze in de computer!  Je kan ook voor de zomer inschrijven via deze <a href=\"../../../inschrijven\" target=\"_blank\">website</a>!</em>\r\n\r\nEen speelpleindag ziet er voor de kinderen als volgt uit:\r\n<table style=\"width: 100%; height: 685px;\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td valign=\"top\" width=\"76\"></td>\r\n<td colspan=\"2\" valign=\"top\" width=\"312\">\r\n<p style=\"text-align: center;\"><strong>Kleuters</strong></p>\r\n<p style=\"text-align: center;\"><strong>3-6j</strong></p>\r\n</td>\r\n<td style=\"text-align: center;\" colspan=\"2\" valign=\"top\" width=\"312\"><strong>Middengroep en tieners</strong>\r\n\r\n<strong>6-11j  en  11-14j</strong></td>\r\n</tr>\r\n<tr>\r\n<td width=\"76\">\r\n<p style=\"text-align: center;\"><strong>8.00u</strong></p>\r\n</td>\r\n<td colspan=\"4\" width=\"624\">\r\n<p style=\"text-align: center;\">Inschrijvingen en opvang</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"76\">\r\n<p style=\"text-align: center;\"><strong>9.00u</strong></p>\r\n</td>\r\n<td style=\"text-align: center;\" width=\"170\">\r\n<p style=\"text-align: center;\">Activiteit + 10-uurtje</p>\r\n</td>\r\n<td style=\"text-align: center;\" width=\"142\">OSA</td>\r\n<td style=\"text-align: center;\" width=\"170\">Activiteiten + 10-uurtje</td>\r\n<td width=\"142\">\r\n<p style=\"text-align: center;\">OSA</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\" width=\"76\"><strong>12.00u</strong></td>\r\n<td colspan=\"4\" width=\"624\">\r\n<p style=\"text-align: center;\">Lunch</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\" width=\"76\"><strong>12.30u</strong></td>\r\n<td colspan=\"4\" width=\"624\">\r\n<p style=\"text-align: center;\">Opvang</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"76\">\r\n<p style=\"text-align: center;\"><strong>13.30u</strong></p>\r\n</td>\r\n<td colspan=\"4\" width=\"624\">\r\n<p style=\"text-align: center;\">Inschrijvingen en opvang</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"76\">\r\n<p style=\"text-align: center;\"><strong>14.00u</strong></p>\r\n</td>\r\n<td style=\"text-align: center;\" width=\"170\">Activiteit + 3-uurtje</td>\r\n<td style=\"text-align: center;\" width=\"142\">OSA</td>\r\n<td style=\"text-align: center;\" width=\"170\">Activiteiten + 3-uurtje</td>\r\n<td width=\"142\">\r\n<p style=\"text-align: center;\">OSA</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\" width=\"76\"><strong>16.00u</strong></td>\r\n<td style=\"text-align: center;\" colspan=\"2\" width=\"312\">Opruimen</td>\r\n<td colspan=\"2\" width=\"312\">\r\n<p style=\"text-align: center;\">Opruimen</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\" width=\"76\"><strong>16.15u</strong></td>\r\n<td colspan=\"4\" width=\"624\">\r\n<p style=\"text-align: center;\">Slotanimatie</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\" width=\"76\"><strong>16.30u</strong></td>\r\n<td colspan=\"4\" width=\"624\">\r\n<p style=\"text-align: center;\">Opvang</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\" width=\"76\"><strong>17.30u</strong></td>\r\n<td colspan=\"4\" width=\"624\">\r\n<p style=\"text-align: center;\">Tot morgen!</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', 'Een speelpleindag', '', 'publish', 'closed', 'closed', '', 'een-speelpleindag', '', '', '2016-07-23 17:18:48', '2016-07-23 15:18:48', '', 0, 'http://speelakkertje.be/?page_id=88', 0, 'page', '', 0),
(89, 1, '2016-07-23 17:18:48', '2016-07-23 15:18:48', 'Iedere dag op het speelplein is anders door de verschillende activiteiten waar je aan kan deelnemen maar een speelpleindag heeft wel een bepaalde structuur.\r\n\r\nElke speelpleindag begint met de inschrijvingen. Je kan kiezen voor een volle dag of een halve dag speelplezier.\r\nVoor een volle dag betaal je €7. Bij deze optie moet je kind eigen lunchpakket meenemen. <span style=\"text-decoration: underline;\">Vanaf de zomer van 2016 is het wel mogelijk om op vrijdagmiddag hot dogs te krijgen. Voor €1 kan je kind dan zoveel hot dogs eten als hij/zij wil om hun buikje te vullen.</span> Voor een halve dag betaal je €3. In dit bedrag is inbegrepen: een koekje en drankje om 10.00u en/of 15.00u, verzekering en een fantastische speel(namid)dag!\r\n\r\n<em>Kinderen die voor het eerst deze zomer komen, vullen hun gegevens in op een inschrijvingsfiche.  De volgende dag zitten ze in de computer!  Je kan ook voor de zomer inschrijven via deze <a href=\"../../../inschrijven\" target=\"_blank\">website</a>!</em>\r\n\r\nEen speelpleindag ziet er voor de kinderen als volgt uit:\r\n<table style=\"width: 100%; height: 685px;\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td valign=\"top\" width=\"76\"></td>\r\n<td colspan=\"2\" valign=\"top\" width=\"312\">\r\n<p style=\"text-align: center;\"><strong>Kleuters</strong></p>\r\n<p style=\"text-align: center;\"><strong>3-6j</strong></p>\r\n</td>\r\n<td style=\"text-align: center;\" colspan=\"2\" valign=\"top\" width=\"312\"><strong>Middengroep en tieners</strong>\r\n\r\n<strong>6-11j  en  11-14j</strong></td>\r\n</tr>\r\n<tr>\r\n<td width=\"76\">\r\n<p style=\"text-align: center;\"><strong>8.00u</strong></p>\r\n</td>\r\n<td colspan=\"4\" width=\"624\">\r\n<p style=\"text-align: center;\">Inschrijvingen en opvang</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"76\">\r\n<p style=\"text-align: center;\"><strong>9.00u</strong></p>\r\n</td>\r\n<td style=\"text-align: center;\" width=\"170\">\r\n<p style=\"text-align: center;\">Activiteit + 10-uurtje</p>\r\n</td>\r\n<td style=\"text-align: center;\" width=\"142\">OSA</td>\r\n<td style=\"text-align: center;\" width=\"170\">Activiteiten + 10-uurtje</td>\r\n<td width=\"142\">\r\n<p style=\"text-align: center;\">OSA</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\" width=\"76\"><strong>12.00u</strong></td>\r\n<td colspan=\"4\" width=\"624\">\r\n<p style=\"text-align: center;\">Lunch</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\" width=\"76\"><strong>12.30u</strong></td>\r\n<td colspan=\"4\" width=\"624\">\r\n<p style=\"text-align: center;\">Opvang</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"76\">\r\n<p style=\"text-align: center;\"><strong>13.30u</strong></p>\r\n</td>\r\n<td colspan=\"4\" width=\"624\">\r\n<p style=\"text-align: center;\">Inschrijvingen en opvang</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"76\">\r\n<p style=\"text-align: center;\"><strong>14.00u</strong></p>\r\n</td>\r\n<td style=\"text-align: center;\" width=\"170\">Activiteit + 3-uurtje</td>\r\n<td style=\"text-align: center;\" width=\"142\">OSA</td>\r\n<td style=\"text-align: center;\" width=\"170\">Activiteiten + 3-uurtje</td>\r\n<td width=\"142\">\r\n<p style=\"text-align: center;\">OSA</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\" width=\"76\"><strong>16.00u</strong></td>\r\n<td style=\"text-align: center;\" colspan=\"2\" width=\"312\">Opruimen</td>\r\n<td colspan=\"2\" width=\"312\">\r\n<p style=\"text-align: center;\">Opruimen</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\" width=\"76\"><strong>16.15u</strong></td>\r\n<td colspan=\"4\" width=\"624\">\r\n<p style=\"text-align: center;\">Slotanimatie</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\" width=\"76\"><strong>16.30u</strong></td>\r\n<td colspan=\"4\" width=\"624\">\r\n<p style=\"text-align: center;\">Opvang</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\" width=\"76\"><strong>17.30u</strong></td>\r\n<td colspan=\"4\" width=\"624\">\r\n<p style=\"text-align: center;\">Tot morgen!</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', 'Een speelpleindag', '', 'inherit', 'closed', 'closed', '', '88-revision-v1', '', '', '2016-07-23 17:18:48', '2016-07-23 15:18:48', '', 88, 'http://speelakkertje.be/?p=89', 0, 'revision', '', 0),
