(93, 1, '2016-07-23 17:19:41', '2016-07-23 15:19:41', '<h1>Introductie</h1>\r\n<img class=\"image_padding\" src=\"img/teddy.jpg\" alt=\"Teddy\" width=\"120\" height=\"113\" align=\"right\" />\r\n\r\nTijdens de zomervakantie stellen wij onze deuren wagenwijd open voor alle kinderen van <strong>3 tot 15 jaar</strong>! Met een enthousiaste groep van ongeveer veertig animatoren staan wij al meer dan 15 jaar in voor ongelooflijk veel speelplezier aan de rand van <strong>Oostakker</strong>.\r\n\r\nDeze zomer zijn we er weer van <strong>11 juli t.e.m. 12 augustus</strong>. We voorzien voor elk kind een aanbod van dagelijkse animatie, plezier en begeleiding op leeftijd.\r\n\r\nMocht u of uw kind nog twijfelen, of vragen hebben, twijfel dan zeker niet om eens binnen te springen, of neem contact met ons op. We zijn er zeker van dat de komende zomermaanden vanaf nu een aangename belevenis kunnen betekenen en een verrijking voor elk kind zijn leeromgeving.', 'Home', '', 'inherit', 'closed', 'closed', '', '92-revision-v1', '', '', '2016-07-23 17:19:41', '2016-07-23 15:19:41', '', 92, 'http://speelakkertje.be/?p=93', 0, 'revision', '', 0),
(94, 1, '2016-07-23 17:20:10', '2016-07-23 15:20:10', '<strong>Eerst en vooral hebben we altijd plaats voor al jouw kinderen, we zijn nooit volzet en geven elk kind een prachtige speeldag. </strong>\r\n\r\nEven een kort woordje uitleg over hoe ons nieuw systeem werkt:\r\n\r\nDe volgende stappen zijn <strong>NIET VERPLICHT, </strong>dit kan ook <strong>ter plaatse gebeuren</strong> via een inschrijvingsfiche. We hebben gekozen voor een vast login systeem waar je jouw persoonlijke gegevens en de gegevens van jouw kind kan invullen en ook kan veranderen achteraf.\r\n\r\nMocht je in de zomer of tijdens het jaar verhuizen, kan dat door jezelf ingevuld worden zonder dat je de hele inschrijving opnieuw hoeft te doen.\r\n\r\nEr is een speciale button die je vraagt of jouw kind dit jaar komt of niet, <strong>als je hier neen aanduidt, wordt je kind niet toegevoegd aan de inschrijvingen</strong>.\r\n\r\nNa het einde van de zomer zetten we de actie actief bij iedereen op \"neen\". Er volgt dan een mail waarin gevraagd wordt of jouw kind het volgende jaar opnieuw komt. Je kan dan gewoon weer \"ja\" aanduiden zonder je persoonlijke gegevens en de gegevens van je kind kwijt te raken.\r\n\r\n<strong>Hoe maak je een account aan?</strong>\r\n\r\nEerst moet je een account aanmaken door op de link <span style=\"text-decoration: underline;\">login</span> te klikken, daar vragen we om standaardgegevens:\r\n<ul>\r\n 	<li>je e-mailadres</li>\r\n 	<li>een wachtwoord</li>\r\n</ul>\r\nDaarna vragen we om je persoonlijke gegevens in te vullen zoals naam, telefoonnummer en adres. Deze gegevens kunnen ook enkel door de <span class=\"s1\">pleinverantwoordelijken gezien worden. Tot slot vul je de gegevens van je kinderen in en dan is de inschrijving van je kind voltooid.</span>\r\n\r\nVanaf dan zie je de gegevens van je kind staan bij \"mijn kind(eren)\", zo weet je zeker dat je kind goed ingeschreven is en bij ons geregistreerd is.\r\n\r\nAan het begin van de zomer zal <strong>als je geklikt hebt op \'mijn kind komt dit jaar\',</strong> een pasje klaar liggen voor je kind(eren).\r\n\r\nHeb je eventueel verdere vragen, stuur dan gerust een mail naar <span style=\"text-decoration: underline;\">info@speelakkertje.be</span>\r\n\r\nWaar wacht je nog op en <a href=\"http://speelakkertje.be/aanmelden/\">maak een account aan</a>!', 'Info inschrijvingen', '', 'publish', 'closed', 'closed', '', 'info-inschrijvingen', '', '', '2016-07-24 21:28:09', '2016-07-24 19:28:09', '', 0, 'http://speelakkertje.be/?page_id=94', 0, 'page', '', 0),
(95, 1, '2016-07-23 17:20:10', '2016-07-23 15:20:10', '<strong>Eerst en vooral hebben we altijd plaats voor al u kinderen, we zitten nooit volzet en geven elk kind een prachtige speeldag. </strong>\r\n\r\nEven een kort woordje uitleg over hoe ons nieuw systeem werkt:\r\n\r\nDe volgende stappen zijn <strong>NIET VERPLICHT, </strong>dit kan ook <strong>ter plaatsen gebeuren</strong> via een inschrijvingsfiche. We hebben gekozen voor een vast login systeem waar je je persoonlijke gegevens en de gegevens van je kind kan invullen en ook kan veranderen achteraf.\r\n\r\nMocht je in de zomer of in het jaar verhuizen kan dat door jullie zelf ingevuld worden zonder de hele inschrijving opnieuw te moeten doen.\r\n\r\nEr is een speciale button die je vraagt of je kind dit jaar komt of niet, <strong>als u hier neen aanduidt, word uw kind niet toegevoegd aan de inschrijvingen</strong>.\r\n\r\nNa het einde van de zomer zetten we de actie actief bij iedereen op \"neen\". Er volgt dan een mail waarin er gevraagd wordt of uw kind het volgende jaar opnieuw komt. U kan dan gewoon weer \"ja\" aanduiden zonder uw persoonlijke gegevens en de gegevens van uw kind kwijt te raken.\r\n\r\n<strong>Hoe maakt u een account aan?</strong>\r\n\r\nEerst moet u een account aan maken door op de link <span style=\"text-decoration: underline;\">login</span> te duwen, daar vragen we om standaard gegevens:\r\n<ul>\r\n 	<li>uw emailadres</li>\r\n 	<li>een wachtwoord</li>\r\n</ul>\r\nDaarna vragen we om u persoonlijke gegevens in te vullen zoals naam, telefoon nummer en adres. Deze gegevens kunnen ook enkel door de <span class=\"s1\">pleinverantwoordelijken gezien worden. Tot slot moet u nog de gegevens van uw kinderen invullen en dan is de inschrijving van uw kind voltooid.</span>\r\n\r\nVanaf dan ziet u de gegevens van uw kind staan bij \"mijn kind(eren)\", zo weet u zeker dat uw kind goed ingeschreven is en bij ons geregistreerd is.\r\n\r\nAan het begin van de zomer zal <strong>als u geklikt hebt op \'mijn kind komt dit jaar\'</strong> een pasje klaar liggen voor uw kind(eren).\r\n\r\nHebt u eventueel verdere vragen, stuur dan gerust een mail naar <span style=\"text-decoration: underline;\">info@speelakkertje.be</span>', 'Info inschrijvingen', '', 'inherit', 'closed', 'closed', '', '94-revision-v1', '', '', '2016-07-23 17:20:10', '2016-07-23 15:20:10', '', 94, 'http://speelakkertje.be/?p=95', 0, 'revision', '', 0),
