(106, 1, '2016-07-23 17:24:23', '2016-07-23 15:24:23', 'Speelplein ’t Speelakkertje v.z.w. biedt sinds 1997 gedurende de zomermaanden kinderen de mogelijkheid om fantastische momenten te beleven. We zijn lid van de Vlaamse Dienst Speelpleinwerk en staan dus achter deze visie. <img class=\"wp-image-390 alignright\" style=\"padding-top: 1em;\" src=\"http://beta.speelakkertje.be/wordpress/wp-content/uploads/2016/07/13620272_1268408266517333_1787683883583352447_n-300x200.jpg\" alt=\"13620272_1268408266517333_1787683883583352447_n\" width=\"342\" height=\"237\" />Het belang van het kind is hierbij ons uitgangspunt: respect voor de eigenheid van de kinderen, geloof in de ontwikkeling van het kind door het geven van impulsen en geloof in de zelfstandige ontplooiing van kinderen door het spelen.', 'Onze visie', '', 'publish', 'closed', 'closed', '', 'onze-visie', '', '', '2016-07-23 17:24:23', '2016-07-23 15:24:23', '', 0, 'http://speelakkertje.be/?page_id=106', 0, 'page', '', 0),
(107, 1, '2016-07-23 17:24:23', '2016-07-23 15:24:23', 'Speelplein ’t Speelakkertje v.z.w. biedt sinds 1997 gedurende de zomermaanden kinderen de mogelijkheid om fantastische momenten te beleven. We zijn lid van de Vlaamse Dienst Speelpleinwerk en staan dus achter deze visie. <img class=\"wp-image-390 alignright\" style=\"padding-top: 1em;\" src=\"http://beta.speelakkertje.be/wordpress/wp-content/uploads/2016/07/13620272_1268408266517333_1787683883583352447_n-300x200.jpg\" alt=\"13620272_1268408266517333_1787683883583352447_n\" width=\"342\" height=\"237\" />Het belang van het kind is hierbij ons uitgangspunt: respect voor de eigenheid van de kinderen, geloof in de ontwikkeling van het kind door het geven van impulsen en geloof in de zelfstandige ontplooiing van kinderen door het spelen.', 'Onze visie', '', 'inherit', 'closed', 'closed', '', '106-revision-v1', '', '', '2016-07-23 17:24:23', '2016-07-23 15:24:23', '', 106, 'http://speelakkertje.be/106-revision-v1/', 0, 'revision', '', 0),
(108, 1, '2016-07-23 17:24:42', '2016-07-23 15:24:42', 'Wij bieden de kinderen een tal van mogelijkheden tot spelen: de namiddag wordt opgesplitst in twee delen waarbij er in elk deel telkens drie <strong>activiteiten</strong> doorgaan waaruit de kinderen vrij kunnen kiezen.  Hierbij letten de pleinverantwoordelijken op de <strong>kwaliteit en variëteit</strong> van de activiteiten.  Daarnaast is er de hele namiddag een <strong>openspelaanbod</strong> (OSA), wat inhoudt dat de kinderen mogen doen wat ze willen: een bouwdorp, een go-cartparcours, een winkeltje waar ze verschillende spelmaterialen kunnen uitlenen, …  De OSA-animatoren geven impulsen om het speelplezier hier te verhogen!\r\n<h3></h3>\r\n<h4>Voor de kleine spruiten</h4>\r\n<strong>De kleuters</strong> zitten in een apart <strong>Kleuterdorp</strong> waar ze naar hartelust kunnen spelen: een ballenbad, een knuffelhoek, een stel glijbanen, een trampoline, …  Kortom: verveling komt zelden voor!  Alle 3- tot 5-jarigen worden sowieso tot deze groep gerekend.  Kinderen die naar het eerste leerjaar gaan, mogen kiezen of ze de voorkeur geven aan het knusse kleuterdorp of liever al bij de groten vertoeven.\r\n<h4>Tieners</h4>\r\nVoor de oudste kinderen, <strong>de tieners</strong> is er een eigen plekje waarin ze rustig kunnen chillen.  Tiener ben je vanaf het jaar waarin je elf wordt, maar je kan als tiener uiteraard vrij aansluiten bij de middengroep.', 'Onze werking', '', 'publish', 'closed', 'closed', '', 'onze-werking', '', '', '2016-07-23 17:24:42', '2016-07-23 15:24:42', '', 0, 'http://speelakkertje.be/?page_id=108', 0, 'page', '', 0),
(109, 1, '2016-07-23 17:24:42', '2016-07-23 15:24:42', 'Wij bieden de kinderen een tal van mogelijkheden tot spelen: de namiddag wordt opgesplitst in twee delen waarbij er in elk deel telkens drie <strong>activiteiten</strong> doorgaan waaruit de kinderen vrij kunnen kiezen.  Hierbij letten de pleinverantwoordelijken op de <strong>kwaliteit en variëteit</strong> van de activiteiten.  Daarnaast is er de hele namiddag een <strong>openspelaanbod</strong> (OSA), wat inhoudt dat de kinderen mogen doen wat ze willen: een bouwdorp, een go-cartparcours, een winkeltje waar ze verschillende spelmaterialen kunnen uitlenen, …  De OSA-animatoren geven impulsen om het speelplezier hier te verhogen!\r\n<h3></h3>\r\n<h4>Voor de kleine spruiten</h4>\r\n<strong>De kleuters</strong> zitten in een apart <strong>Kleuterdorp</strong> waar ze naar hartelust kunnen spelen: een ballenbad, een knuffelhoek, een stel glijbanen, een trampoline, …  Kortom: verveling komt zelden voor!  Alle 3- tot 5-jarigen worden sowieso tot deze groep gerekend.  Kinderen die naar het eerste leerjaar gaan, mogen kiezen of ze de voorkeur geven aan het knusse kleuterdorp of liever al bij de groten vertoeven.\r\n<h4>Tieners</h4>\r\nVoor de oudste kinderen, <strong>de tieners</strong> is er een eigen plekje waarin ze rustig kunnen chillen.  Tiener ben je vanaf het jaar waarin je elf wordt, maar je kan als tiener uiteraard vrij aansluiten bij de middengroep.', 'Onze werking', '', 'inherit', 'closed', 'closed', '', '108-revision-v1', '', '', '2016-07-23 17:24:42', '2016-07-23 15:24:42', '', 108, 'http://speelakkertje.be/108-revision-v1/', 0, 'revision', '', 0),
(110, 1, '2016-07-23 17:25:11', '2016-07-23 15:25:11', '<div id=\"column_right\" style=\"width: 30%;float: right;padding: 5%\">\r\n<div class=\"side_menu\">\r\n<h2>Praktische informatie</h2>\r\n<ul>\r\n 	<li><a href=\"http://speelakkertje.be/onze-visie/\">Onze visie</a></li>\r\n 	<li><a href=\"http://speelakkertje.be/onze-werking/\">Onze werking</a></li>\r\n 	<li><a href=\"http://speelakkertje.be/een-speelpleindag/\">Een speelpleindag</a></li>\r\n 	<li><a href=\"http://speelakkertje.be/kledij/\">Kledij</a></li>\r\n 	<li><a href=\"http://speelakkertje.be/animatorenploeg/\">De animatorenploeg</a></li>\r\n 	<li><a href=\"http://speelakkertje.be/animator-worden/\">Animator worden</a></li>\r\n 	<li><a href=\"http://speelakkertje.be/de-staf/\">onze staf</a></li>\r\n 	<li><a href=\"http://speelakkertje.be/wie-is-wie/\">wie is wie</a></li>\r\n</ul>\r\n</div>\r\n</div>\r\n<div id=\"main_left\">\r\n<h1>Praktisch</h1>\r\nWe zijn een toffe groep van ongeveer 45 enthousiaste animatoren die al negentien jaar lang de kinderen in en rond Oostakker ongelofelijk veel speelplezier bieden tijdens de zomervakantie!  Met een gemiddelde opkomst van zo’n 120 pagadders per dag zijn we een van de grootste, (en ongetwijfeld één van de leukste) speelpleinwerkingen in Gent!\r\n\r\nJe vindt ons op de terreinen van <strong>EDUGO campus De Toren</strong>, <span style=\"text-decoration: underline\">Sint-Jozefstraat 10 in Oostakker</span>.  De ingang van het speelplein vind je achter de glazen deur, bereikbaar langs de dreef met kiezelsteentjes.\r\n\r\nAls je met de fiets naar het plein komt, is er ook een fietsenstalling voorzien speciaal voor jullie. Jullie kunnen daar de fietsen plaatsen en tijdens het speelplein gaat de stalling op slot om diefstal te voorkomen.\r\n\r\n[caption id=\"attachment_400\" align=\"alignleft\" width=\"300\"]<img class=\"wp-image-400 size-medium\" src=\"http://beta.speelakkertje.be/wordpress/wp-content/uploads/2016/07/Toren-300x200.jpg\" alt=\"Toren\" width=\"300\" height=\"200\" /> Bron: http://cms.edugo.be/[/caption]\r\n\r\n</div>', 'Praktisch', '', 'publish', 'closed', 'closed', '', 'praktisch', '', '', '2017-01-29 14:58:44', '2017-01-29 13:58:44', '', 0, 'http://speelakkertje.be/?page_id=110', 0, 'page', '', 0),
(111, 1, '2016-07-23 17:25:11', '2016-07-23 15:25:11', '<div id=\"column_right\" style=\"width: 30%; float: right; padding: 5%;\">\r\n<div class=\"side_menu\">\r\n<h2>Praktische informatie</h2>\r\n<ul>\r\n 	<li><a href=\"/praktisch/onze_visie\">Onze visie</a></li>\r\n 	<li><a href=\"/praktisch/onze_werking\">Onze werking</a></li>\r\n 	<li><a href=\"/praktisch/een_speelpleindag\">Een speelpleindag</a></li>\r\n 	<li><a href=\"/praktisch/kledij\">Kledij</a></li>\r\n 	<li><a href=\"/praktisch/de_animatorenploeg\">De animatorenploeg</a></li>\r\n 	<li><a href=\"/praktisch/animator-worden\">Animator worden</a></li>\r\n</ul>\r\n</div>\r\n</div>\r\n<div id=\"main_left\">\r\n<h1>Praktisch</h1>\r\nWe zijn een toffe groep van ongeveer 45 enthousiaste animatoren die al negentien jaar lang de kinderen in en rond Oostakker ongelooflijk veel speelplezier bieden tijdens de zomervakantie!  Met een gemiddelde opkomst van zo’n 120 pagadders per dag zijn we een van de grootste, (en ongetwijfeld één van de leukste) speelpleinwerkingen in Gent!\r\n\r\nJe vindt ons op de terreinen van <strong>EDUGO campus De Toren</strong>, <span style=\"text-decoration: underline;\">Sint-Jozefstraat 10 in Oostakker</span>.  De ingang van het speelplein vind je achter de glazen deur, bereikbaar langs de dreef met kiezelsteentjes.\r\n\r\nAls je met de fiets naar het plein komt, is er ook een fietsenstalling voorzien speciaal voor jullie. Jullie kunnen daar de fietsen plaatsen en tijdens het speelplein gaat de stalling op slot om diefstal te voorkomen.\r\n\r\n[caption id=\"attachment_400\" align=\"alignleft\" width=\"300\"]<img class=\"wp-image-400 size-medium\" src=\"http://beta.speelakkertje.be/wordpress/wp-content/uploads/2016/07/Toren-300x200.jpg\" alt=\"Toren\" width=\"300\" height=\"200\" /> Bron: http://cms.edugo.be/[/caption]\r\n\r\n</div>', 'Praktisch', '', 'inherit', 'closed', 'closed', '', '110-revision-v1', '', '', '2016-07-23 17:25:11', '2016-07-23 15:25:11', '', 110, 'http://speelakkertje.be/110-revision-v1/', 0, 'revision', '', 0),
