(425, 1, '2012-05-09 20:20:46', '0000-00-00 00:00:00', '<p>Lieve vrienden van het speelplein,</p>\r\n<p>Ook dit jaar zijn we er weer!&nbsp;<span>Van <strong>9 juli t.e.m. 10 augustus</strong></span>&nbsp;kunnen jullie alle weekdagen \'s namiddags komen spelen!<br />En op&nbsp;<span>11 juli</span>&nbsp;vieren we onze&nbsp;<strong>15de verjaardag</strong>!!&nbsp; Houd die dag alvast vrij in jouw agenda en die van je ouders.</p>\r\n<p>Graag tot dan!<br />Speelse groeten</p>', 'Speelplein in 2012', '', 'publish', 'open', 'open', '', 'speelplein_in_2012', '', '', '2012-05-16 23:27:30', '0000-00-00 00:00:00', '', 0, '4faab57e-f5e4-4ba9-8679-65b9b2163834.jpg', 0, 'post', '', 0),
(426, 1, '2012-05-09 20:26:15', '0000-00-00 00:00:00', '<p>Aan allen die jarig zijn, proficiat!&nbsp; Aan allen die niet jarig zijn, ook proficiat!</p>\r\n<p>Speelplein \'t Speelakkertje werd opgericht in 1997 en we bestaan dus dit jaar&nbsp;<strong>15 jaar</strong>!<br />Een gelukkige verjaardag aan alle kinderen, animatoren, ouders van kinderen en van animatoren, sympathisanten en alle andere personen die deze 15 jaar mogelijk hebben gemaakt!!</p>\r\n<p>Er volgen enkele grote verjaardagsacties, waaronder een heus<strong>&nbsp;verjaardagsfeest&nbsp;</strong>op&nbsp;<strong>11 juli</strong>.&nbsp; Binnenkort meer hierover! Maar houd die dag alvast vrij!</p>\r\n<p>Speelse groeten</p>', 'Speelplein \'t Speelakkertje 15 jaar', '', 'publish', 'open', 'open', '', 'speelplein_t_speelakkertje_bestaat_15_jaar', '', '', '2012-05-16 23:27:40', '0000-00-00 00:00:00', '', 0, '4faab6c6-9c70-473e-97b9-7f06b2163834.jpg', 0, 'post', '', 0),
(427, 69, '2012-05-16 23:31:00', '0000-00-00 00:00:00', '<p>Om onze verjaardag op een feestelijke wijze aan te kondigen in Oostakker en omstreken, hebben we&nbsp;voorbije zaterdag&nbsp;duizenden kleurrijke ballonnen opgehangen aan hekkens, poorten, voordeuren, &hellip; van mensen en instellingen met een hart voor het speelplein.</p>\r\n<p>Een welgemeende dankjewel aan al wie net zoals wij de ballonnen ophing; aan al wie toestemming gaf om hun hekken, poort of voordeur vol te hangen!<br />Evenals voor de animatoren die de vele ballonnen van lucht hebben voorzien!</p>\r\n<p>Graag tot deze zomer of de volgende PR-actie! <br />Feestelijke groetjes, <br />Lieselotte&nbsp;</p>', 'â€˜t Speelakkertje zet Oostakker in ballonnen', '', 'publish', 'open', 'open', '', 't_speelakkertje_zet_oostakker_in_ballonnen', '', '', '2012-05-17 18:10:24', '0000-00-00 00:00:00', '', 0, '4fb41c92-97b8-4ea5-bad7-54f5b2163834.JPG', 0, 'post', '', 0),
(428, 72, '2012-07-10 19:15:46', '0000-00-00 00:00:00', '<p>De speelpleinzomer is goed gestart!&nbsp;</p>\r\n<p>Dit jaar toverden we de school om tot een elfen- en trollendorp.&nbsp; Benieuwd hoe het eruit ziet?&nbsp; Dan ben je zeker welkom deze zomer!</p>', 'Het speelplein is gestart!', '', 'publish', 'open', 'open', '', 'het_speelplein_is_gestart', '', '', '2012-07-10 21:29:09', '0000-00-00 00:00:00', '', 0, '4ffc6342-198c-4e24-815a-0d904d49626e.jpg', 0, 'post', '', 0),
(429, 72, '2012-07-10 21:26:44', '0000-00-00 00:00:00', '<p>Morgen vieren we onze 15de verjaardag en jij kan erbij zijn!</p>\r\n<p>Vanaf 13h30 voorzien we voor de kinderen tal van verrassingen, maar dat is niet alles!&nbsp; Vanaf 16h zetten we de deuren open voor de buurt, ouders en andere nieuwsgierigen.&nbsp; Kom gerust een kijkje nemen op de rommelmarkt!</p>\r\n<p>We sluiten de speelpleindag af met een grote receptie, gevolgd door een barbecue</p>\r\n<p>Graag tot dan!</p>', '\'t Speelakkertje viert feest!', '', 'publish', 'open', 'open', '', 't_speelakkertje_viert_feest', '', '', '2012-07-10 21:26:44', '0000-00-00 00:00:00', '', 0, '4ffc81f4-860c-4dc7-ab8d-7c084d49626e.jpg', 0, 'post', '', 0),
(430, 72, '2012-07-16 22:21:35', '0000-00-00 00:00:00', '<p>De tweede speelpleinweek is van start gegaan!&nbsp; Deze week staan Jirke, Florian en Lieselotte klaar voor al jullie vragen!</p>\r\n<p>Mogen wij jullie ook vragen om niet meer via internet vooraf in te schrijven?&nbsp; Op het speelplein hebben wij namelijk geen internettoegang, waardoor wij nieuwe inschrijvingen niet kunnen downloaden.<br />Dank voor het begrip!</p>', 'Week 2 is gestart!', '', 'publish', 'open', 'open', '', 'week_2_is_gestart', '', '', '2012-07-16 22:21:35', '0000-00-00 00:00:00', '', 0, '500477cf-3f58-42e9-897a-05874d49626e.JPG', 0, 'post', '', 0),
(431, 69, '2012-09-18 15:20:48', '0000-00-00 00:00:00', '<p>Ook dit jaar organiseerden we vanuit het speelplein een speelpleinfuif, namelijk: <strong>GlowMotion !</strong> <br />Met<strong> 630 aanwezigen</strong> mogen we best trots zijn op het resultaat ! <br />Het <em>ingezamelde geld</em> zal dan ook zorgen voor nieuw materiaal op het speelplein; hoera ! <br />Hierbij willen we graag al de medewerkers nog eens extra bedanken, eveneens de sponsors ! <br /><strong>BEDANKT !</strong></p>', 'GlowMotion', '', 'publish', 'open', 'open', '', 'glowmotion', '', '', '2012-09-18 15:20:48', '0000-00-00 00:00:00', '', 0, '50587530-a908-4c26-ace1-4d2f4d49626e.jpg', 0, 'post', '', 0),
(432, 69, '2012-11-18 15:37:48', '0000-00-00 00:00:00', '<p>Ben jij een enthousiaste persoon, geboren in of voor 1998, die ons animatorenteam wil versterken en niet bang is om de eigen grenzen te verleggen en nieuwe mensen te leren kennen ? <br />Dan ben je bij ons aan het juiste adres ! ( joehoe! ) <br />Kom eens proeven van de sfeer op <span style=\"text-decoration: underline;\"><strong>vrijdag 23 november van 19U30 tot 22U</strong></span> op onze infoavondactiviteit. <br />Dit gaat door op het speelpleinterrein = op edugo de toren. ( <span style=\"text-decoration: underline;\">Sint-Jozefstraat 10, Oostakker</span>. Ingang langs de dreef. )<br /><br />Kan je niet komen, wil je meer info of heb je andere vragen? <br />Aarzel dan niet om ons te mailen op <a href=\"mailto:speelakkertje@hotmail.com\">speelakkertje@hotmail.com</a> of voeg ons toe op facebook ! <br />( op deze site vind je ook de stafleden van het speelplein, met je vragen kan je steeds bij hen terecht! --&gt; zie \'praktisch\' : \'wie is wie.\' )<br /><br />Tot dan !</p>', 'Wij zoeken nieuwe animatoren !! ', '', 'publish', 'open', 'open', '', 'wij_zoeken_nieuwe_animatoren', '', '', '2012-11-18 15:39:00', '0000-00-00 00:00:00', '', 0, '50a8f2bc-e4ac-4392-ade2-73994d49626e.jpg', 0, 'post', '', 0),
(433, 69, '2012-12-23 14:09:35', '0000-00-00 00:00:00', '<p><span class=\"userContent\">Op 5 januari organiseert <a href=\"http://www.facebook.com/speelplein.tspeelakkertje?group_id=0\" data-hovercard=\"/ajax/hovercard/user.php?id=100001985035574&amp;extragetparams=%7B%22group_id%22%3A0%7D\">Speelplein \'t Speelakkertje</a> een nieuwjaarsreceptie voor al haar animatoren. Ook nieuwe animatoren zijn van harte welkom! Ben jij minimum 15 jaar of wordt je 15 jaar in 2013 en zie je het wel zitten om animator te worden? Kom dan naar onze receptie in het Maegher Goet, Pijphoekstraat 34, 9041 Oostakker. De receptie zal doorgaan van 20u-21u. Wie daarna nog langer wil blijven, kan gerust!</span></p>', 'Nieuwjaarsreceptie 05/01', '', 'publish', 'open', 'open', '', 'nieuwjaarsreceptie_05_01', '', '', '2012-12-23 14:09:35', '0000-00-00 00:00:00', '', 0, '50d7028f-70b4-4665-a017-444d4d49626e.jpg', 0, 'post', '', 0),
(434, 73, '2013-02-17 17:57:11', '0000-00-00 00:00:00', '<p>Op <strong>woensdag 27 maart </strong>zal speelplein \'t Speelakkertje aanwezig zijn op de buitenspeeldag! Van <span style=\"text-decoration: underline;\">13u tot 17u</span> staan we in de <span style=\"text-decoration: underline;\">Louise Derachestraat</span>&nbsp;om mee te spelen met alle kinderen die willen komen! Breng gerust je eigen speelgoed mee. Meer informatie kan je vinden op de flyer. Deze staat ook op onze facebook pagina:&nbsp;https://www.facebook.com/speelplein.tspeelakkertje?fref=ts<br />Kom jij ook?&nbsp;</p>', 'Buitenspeeldag', '', 'publish', 'open', 'open', '', 'buitenspeeldag', '', '', '2013-02-17 17:58:52', '0000-00-00 00:00:00', '', 0, '51210be7-cedc-432b-bdca-454f4d49626e.jpg', 0, 'post', '', 0),
(435, 73, '2013-03-31 21:35:57', '0000-00-00 00:00:00', '<p><span>Beste ouders, grootouders,</span></p>\r\n<p><span>Op&nbsp;<strong>zaterdag 6 april</strong>&nbsp;organiseert speelplein \'t Speelakkertje een kindercinema voor alle kindjes van 3-12 jaar. Deze zal doorgaan van&nbsp;<span style=\"text-decoration: underline;\">15-18u</span>&nbsp;op het speelplein zelf.&nbsp;Meer info kan u vinden bij documenten &gt; brieven.</span></p>\r\n<p><span>Hopelijk tot dan!</span></p>\r\n<p><span>Vriendelijke groeten,<br /> De staf</span></p>\r\n<p><span>PS: Vergeet zeker niet in te schrijven voor deze supertoffe namiddag!&nbsp;</span></p>', 'Kindercinema 6 april', '', 'publish', 'open', 'open', '', 'kindercinema_6_april', '', '', '2013-03-31 21:35:57', '0000-00-00 00:00:00', '', 0, '5158901d-5988-4519-a765-08b74d49626e.jpg', 0, 'post', '', 0),
(436, 73, '2013-05-26 16:17:44', '0000-00-00 00:00:00', '<p>\'t Speelakkertje opent bijna terug zijn deuren! Dit jaar zijn we er weer van 8 juli t.e.m. 9 augustus.<br />Zoals jullie misschien al op de flyer hebben kunnen zien (deze staat ook bij \'documenten\') zijn er dit jaar weer springkastelen op het speelplein. En dit op volgende data: 15 juli, 22 juli, 23 juli, 29 juli, 31 juli &amp; 2 augustus.<br />Ook kan je op 24 juli en 31 juli een ritje met de quad maken (met begeleiding natuurlijk).<br />Maar dat is nog niet alles! Op 1 augustus gaan we met alle kindjes die willen gaan zwemmen in het zwembad Rosas. En ook kleuter- en tieneruitstappen ontbreken niet deze zomer. De brieven hiervan kan je binnnekort vinden onder \'documenten\' &gt; \'brieven\'&nbsp;</p>', '\'t Speelakkertje is er weer!', '', 'publish', 'open', 'open', '', 't_speelakkertje_is_er_weer', '', '', '2013-05-26 16:17:44', '0000-00-00 00:00:00', '', 0, '51a21988-3c3c-4fcc-a7be-7de14d49626e.jpg', 0, 'post', '', 0),
(437, 73, '2013-06-27 18:43:46', '0000-00-00 00:00:00', '<p>Binnenkort is het speelplein er weer. En zoals beloofd zullen er weer heel wat activiteiten te doen zijn!</p>\r\n<p>Bij <span style=\"text-decoration: underline;\">documenten &gt; extra\'s</span> kan u de zomerplanning vinden voor dit jaar. Wat u daar ook zal vinden is een document met inschrijvingsfiches en een document met de strookjes om alleen naar huis te mogen gaan. Deze kan u thuis al invullen en op de eerste dag dat uw kind naar het speelplein komt meebrengen, zo hoeft u dit niet meer ter plaatse te doen.</p>\r\n<p>Bij <span style=\"text-decoration: underline;\">documenten &gt; brieven</span> staan onder andere de ouderbrief voor deze zomer en de brief voor het zwemmen dat op 1 augustus zal doorgaan.</p>\r\n<p>Bij <span style=\"text-decoration: underline;\">documenten &gt; kleuteruitstappen</span> staan de brieven voor de kleuters.</p>\r\n<p>Bij <span style=\"text-decoration: underline;\">documenten &gt; tieneruitstappen</span> staan de brieven voor de tieners.</p>\r\n<p>Is er nog iets niet duidelijk? Wilt u nog wat meer info over de verschillende activiteiten/de springkastelen/de planning/... Vraag dit dan gerust. Dit kan via het contactformulier op onze site, via mail of via telefoon.</p>', 'Zomerplanning 2013', '', 'publish', 'open', 'open', '', 'zomerplanning_2013', '', '', '2013-06-27 18:43:46', '0000-00-00 00:00:00', '', 0, '51cc6bc2-2188-42f5-a7fb-639e4d49626e.jpg', 0, 'post', '', 0),
(438, 69, '2013-07-27 21:29:32', '0000-00-00 00:00:00', '<p>Deze week genoten de kinderen op woensdag 24 juli van een ritje op een grote quad. <br />Op vrijdag 26 juli namen ze zelf het stuur in handen op een kleine quad ! <br />Ook woensdag 31 juli zijn de quads opnieuw op het speelplein voor alle kinderen! <br />Deze week vind je ook een rock &amp; roll springkasteel en een slingerbal! <br /><br />Wij kijken er al naar uit om de kinderen alweer een leuke week te bezorgen!</p>', 'Quad rijden op woensdag 31 juli !', '', 'publish', 'open', 'open', '', 'quad_rijden_op_woensdag_31_juli', '', '', '2013-07-27 21:29:32', '0000-00-00 00:00:00', '', 0, '51f41f9b-fb60-4443-a50b-6dcd4d49626e.jpg', 0, 'post', '', 0),
(439, 73, '2013-11-30 20:46:12', '0000-00-00 00:00:00', '<p>Normaal gezien zou de sint al terug in Spanje zijn, maar voor ons speelplein wil hij een uitzondering maken! Op 7 december komt hij langs. Alle kinderen zijn welkom van 14u30 tot 17u30. Meer info over hoe je moet inschrijven en andere kan je vinden in de brief die bij documenten &gt; brieven staat.<br />Hopelijk tot dan!&nbsp;</p>', 'Sinterklaas komt naar ons speelplein!', '', 'publish', 'open', 'open', '', 'sinterklaas_komt_naar_ons_speelplein', '', '', '2013-11-30 20:46:12', '0000-00-00 00:00:00', '', 0, '529a4084-ca54-42b4-9132-29254d49626e.jpg', 0, 'post', '', 0),
(440, 73, '2014-06-18 20:26:01', '0000-00-00 00:00:00', '<p>Op maandag 7 juli opent het speelplein weer zijn deuren. Er zal weer vanalles te doen zijn: elke week nieuwe springkastelen, kleuteractiviteiten en tieneractiviteiten. Wij hebben alles op een rijtje gezet voor u in een documentje, dit kan je vinden bij documenten &gt; extra. Hopelijk tot deze zomer! :)</p>\r\n<p>Opgelet: de kleuteractiviteiten zijn nog niet ingevuld, deze worden binnenkort aangevuld!&nbsp;</p>', 'Zomerplanning 2014', '', 'publish', 'open', 'open', '', 'zomerplanning_2014', '', '', '2014-06-18 20:26:01', '0000-00-00 00:00:00', '', 0, '53a1d9b9-e178-40de-b8d6-37374d496259.jpg', 0, 'post', '', 0),
(441, 73, '2014-06-24 21:25:38', '0000-00-00 00:00:00', '<p>Via een aantal ouders hebben wij vernomen dat het inschrijven via de site soms niet werkt. Dit kan aan de browser liggen die u gebruikt.</p>\r\n<p>Probeer bij het inschrijven <span style=\"text-decoration: underline;\">Google Chrome</span> te gebruiken, via deze browser lukt het zeker om uw kind in te schrijven. Pas als u \'Uw inschrijving is succesvol verzonden\' op uw scherm ziet staan (zoals de afbeelding bij dit bericht) is uw inschrijving voltooid en is uw kind ingeschreven!</p>', 'Problemen inschrijven via website', '', 'publish', 'open', 'open', '', 'problemen_inschrijven_via_website', '', '', '2014-06-24 21:25:38', '0000-00-00 00:00:00', '', 0, '53a9d0b2-d9f8-47c7-82d0-3b274d496259.jpg', 0, 'post', '', 0),
(442, 73, '2014-11-10 14:18:36', '0000-00-00 00:00:00', '<p>Op zaterdag 22 november organiseert Speelplein \'t Speelakkertje een heuse kids party! Alle kinderen vanaf 6 jaar zijn welkom om 18u op Edugo de Toren (Sint-Jozefstraat 10, Oostakker). Het feestje zal gedaan zijn tegen 21 uur.</p>\r\n<p>Het thema voor dit superzalige feestje is superhelden! Hoe meer kinderen verkleed zijn, hoe meer vreugde. :)</p>\r\n<p>U kan uw kind inschrijven via info@speelakkertje.be. De inkom bedraagt 5 euro, hierin zitten 4 bonnetjes inbegrepen.</p>', 'Kids party', '', 'publish', 'open', 'open', '', 'kids_party', '', '', '2014-11-10 14:18:36', '0000-00-00 00:00:00', '', 0, '5460bb2b-407c-4d0a-b308-5aa24d496259.jpg', 0, 'post', '', 0),
(443, 79, '2014-11-24 15:35:37', '0000-00-00 00:00:00', '<p>Deze zaterdag (29 november) verwelkomen we onze nieuwe animatoren.</p>\r\n<p>Waar en hoelaat?</p>\r\n<p>Alle nieuwe en oude animatoren zijn welkom op Edugo de Toren (ingang langs de groene poort, binnengaan in de rode deur van de turnzaal) om 20 uur. Wat er deze avond zoal te beleven valt, is nog een verrassing. Maar deze avond zal zeker een avond worden om niet te vergeten!</p>\r\n<p>Dus ben jij 15 jaar of ouder, word jij 15 in het jaar 2015, of ken je iemand die ge&iuml;nteresseerd is? Twijfel niet en kom langs!</p>', 'Info avond', '', 'publish', 'open', 'open', '', 'info_avond', '', '', '2014-11-24 22:51:36', '0000-00-00 00:00:00', '', 0, '54734239-5c40-48d4-95bd-5a184d496259.jpg', 0, 'post', '', 0);
