(444, 73, '2014-12-18 14:32:33', '0000-00-00 00:00:00', '<p><span>Speelplein &rsquo;t Speelakkertje wordt EEN VOLLE DAGWERKING!!</span><br /><span>Wat wil dit concreet zeggen?</span><br /><span>Vanaf nu kan u uw kind op 2 momenten inschrijven: tussen 8u-9u voor een volledige dag en tussen 13u30-14u voor een halve dag.</span><br /><span>De prijs voor een volledige dag is &euro;7, een halve dag is &euro;3.</span><br /><span>Vanaf 16u30 kan u uw kind komen ophalen. Er wordt opvang voorzien tot 17u30.</span><br /><br /><span>Om dit allemaal overzichtelijk te maken, zijn we volop aan het werken aan een nieuwe website. Deze zal begin mei gelanceerd worden.</span></p>', 'VOLLE DAGWERKING', '', 'publish', 'open', 'open', '', 'volle_dagwerking', '', '', '2015-02-10 19:44:50', '0000-00-00 00:00:00', '', 0, '5492d771-2c48-41f9-a16e-45534d496259.jpg', 0, 'post', '', 0),
(445, 73, '2015-03-22 16:50:46', '0000-00-00 00:00:00', '<p>U kan uw kind vanaf nu inschrijven voor de zomer van 2015. Dit doet u door op de groene knop \'inschrijvingen\' te klikken op de home pagina.</p>\r\n<p>Dit jaar werken we met een pasje waarop alle gegevens van het kind zullen staan, dit zijn de gegevens die u bij de inschrijving zal moeten invullen. Wij werken niet met inschrijvingen per week of per dag. Wij zetten geen stop op het aantal inschrijvingen. Iedereen is welkom wanneer hij/zij dat wil!</p>', 'Inschrijvingen geopend', '', 'publish', 'open', 'open', '', 'inschrijvingen_geopend', '', '', '2015-03-22 16:50:46', '0000-00-00 00:00:00', '', 0, '550ee4d6-e79c-40cb-ab66-3ade4d496259.jpg', 0, 'post', '', 0),
(446, 73, '2015-05-23 15:39:35', '0000-00-00 00:00:00', '<p>Om de inschrijvingen tijdens de speelpleinweken vlot te laten verlopen, bieden wij u de mogelijkheid om de jetons op voorhand te kopen.<br />Deze jetons dienen als inkom voor het speelplein.</p>\r\n<p>U kan de jetons afhalen op onderstaande data en uren op het speelplein:<br />vrijdag 3 juli van 16u00 - 18u00<br />woensdag 8 juli van 15u00 - 17u00<br />vrijdag 10 juli van 16u00 - 18u00</p>', 'Jetons op voorhand kopen', '', 'publish', 'open', 'open', '', 'jetons_op_voorhand_kopen', '', '', '2015-05-23 15:39:35', '0000-00-00 00:00:00', '', 0, '55608317-752c-44b4-852b-1b634d496259.jpg', 0, 'post', '', 0),
(447, 73, '2015-06-01 12:14:12', '0000-00-00 00:00:00', '<p class=\"p1\"><span class=\"s1\">Omdat we zeer veel vragen krijgen over de fiscale attesten en de zomer zelf, willen we volgende vragen wat meer verduidelijken:</span></p>\r\n<p class=\"p2\">&nbsp;</p>\r\n<p class=\"p1\"><span class=\"s1\">- Hoe kan ik een fiscaal attest aanvragen?</span></p>\r\n<p class=\"p1\"><span class=\"s1\">Je kan dit aanvragen door een mail te sturen naar info@speelakkertje.be met de vermelding van de naam van je kind. We sturen je dan een pdf bestand op.</span></p>\r\n<p class=\"p2\">&nbsp;</p>\r\n<p class=\"p1\"><span class=\"s1\">-Moet ik mijn kind op voorhand inschrijven op de dagen dat hij/zij zal komen?</span></p>\r\n<p class=\"p1\"><span class=\"s1\">Nee, dit hoeft niet. We staan open voor iedereen die zin heeft om eens een dag of halve dag te komen spelen bij ons.</span></p>\r\n<p class=\"p1\"><span class=\"s1\">De inschrijving die momenteel loopt, is om de gegevens van je kind in te vullen. Zo kunnen wij een pasje klaar leggen op de eerste dag dat hij/zij komt.</span></p>\r\n<p class=\"p2\">&nbsp;</p>\r\n<p class=\"p1\"><span class=\"s1\">Voor meer vragen kan je altijd terecht bij info@speelakkertje.be</span></p>', 'Enkele vragen beantwoord', '', 'publish', 'open', 'open', '', 'enkele_vragen_beantwoord', '', '', '2015-06-01 12:14:12', '0000-00-00 00:00:00', '', 0, '556c3074-6878-4c50-821d-0aa94d496259.jpg', 0, 'post', '', 0),
(448, 73, '2015-06-12 16:36:19', '0000-00-00 00:00:00', '<p>Om alles vlot te laten verlopen op de eerste dag dat je kind komt spelen, zouden wij jullie willen vragen om je kind al in te schrijven via de website. Dit kan via volgende link:&nbsp;http://speelakkertje.be/inschrijven</p>\r\n<p>Op die manier verlies je geen tijd meer om ter plaatse je kind in te schrijven en kan je al direct je pasje krijgen met de info van je kind op de eerste speelpleindag.</p>\r\n<div class=\"text_exposed_show\">\r\n<p>En geen nood, wij hebben plaats voor iedereen die een keer goed wil spelen en ravotten! Dus op voorhand aanduiden wanneer je komt is niet nodig. Ons speelplein is er voor iedereen!</p>\r\n</div>', 'Schrijf je kind op voorhand in!', '', 'publish', 'open', 'open', '', 'schrijf_je_kind_op_voorhand_in', '', '', '2015-06-12 16:36:19', '0000-00-00 00:00:00', '', 0, '557aee63-1298-4f9b-9732-67104d496259.png', 0, 'post', '', 0),
(449, 67, '2015-07-15 11:39:49', '0000-00-00 00:00:00', '<p>Beste ouders,</p>\r\n<p>Vanaf nu is het ook mogelijk om uw kind enkel in de voormiddag te laten komen spelen.</p>\r\n<p>Afhalen kan tussen 12u en 12u15 stipt aan de groene poort. Een rode jeton ter waarde van &euro;3 is dus geldig voor een voor- of namiddag speelplezier op \'t Speelakkertje.</p>\r\n<p>Tot binnenkort!</p>\r\n<p>De animatorenploeg&nbsp;</p>', 'Vanaf nu ook voormiddagen speelplezier!', '', 'publish', 'open', 'open', '', 'vanaf_nu_ook_voormiddagen_speelplezier', '', '', '2015-07-15 11:41:07', '0000-00-00 00:00:00', '', 0, '55a62a65-9c14-4e1c-90f0-20cf4d496259.jpg', 0, 'post', '', 0),
(450, 79, '2015-11-15 15:38:48', '0000-00-00 00:00:00', '<p><span>Zoals ieder jaar zoekt het Speelakkertje nieuwe animatoren. Ook dit jaar laten wij een avond het beste van onszelf zien op onze kennismakingsavond! Op deze avond is iedereen welkom ( familie, vrienden, kennissen, liefjes... ) die ge&iuml;nteresserd is in het speelplein om kennis te maken met onze toffe animatorengroep en zich eens goed te amuseren! Je krijgt ook algemene info over ons speelplein.</span><br /><span>Onze kennismakeingsavond zal doorgaan op vrijdag 20 / 11 / 2015, van 20u tot 22u, op Edugo Campus De Toren ( Sint-Jozefstraat 10, 9041 Oostakker ).</span></p>\r\n<p><span>meer info op</span><br /><span>facebook: event: </span><a href=\"https://www.facebook.com/events/1208343832516304/?__mref=message_bubble\" target=\"_blank\">https://www.facebook.com/events/1208343832516304/</a><br /><span>facebook: pagina: </span><a href=\"https://www.facebook.com/speelakkertje/?__mref=message_bubble\" target=\"_blank\">https://www.facebook.com/speelakkertje/</a><br /><span>gsm: 0484/ 94. 69. 95</span></p>\r\n<p><br /><span>Tot dan allemaal</span></p>\r\n<p><span>De staf</span></p>', 'Speelakkertje werft nieuwe animatoren aan!', '', 'publish', 'open', 'open', '', 'speelakkertje_werft_nieuwe_animatoren_aan', '', '', '2015-11-15 15:40:11', '0000-00-00 00:00:00', '', 0, '564898f8-b61c-4d4b-af5e-39884d496259.jpg', 0, 'post', '', 3),
(451, 79, '2015-11-28 20:35:13', '0000-00-00 00:00:00', '<p><span>Dag mede vriendjes en hun ouders</span></p>\r\n<p>In kader van een project van Stad Gent, &ldquo;Wijk van de Maand&rdquo;, wordt er speciaal voor de <strong>jeugd van Oostakker</strong> en daarrond een sint-activiteit georganiseerd. Deze is dus voor de jeugd van Oostakker, maar ook alle leiding van de chiro&rsquo;s, het jeughduis en het Speelplein. In het speelplein geven we even veel om onze animatoren als we om de kinderen geven. Daarom nodigen we jullie <strong>animatoren</strong>&nbsp;met veel plezier uit!</p>\r\n<p><span>Op deze avond kunnen jullie zeggen wat jullie vinden dat er beter kan aan Oostakker, je gekste idee&euml;n &hellip;. tegen jullie liefste kindervriend: de sint! De brave man komt naar Oostakker afgezakt om er een wijze sint-avond van te maken en de avond ook in goede banen te leiden. Wie braaf is, wordt beloond&hellip;. maar wie stout is, krijgt de roe!&nbsp;<br /><br />Van 18u30 tot 19u30 komt de schepen van onderwijs en jeug<span class=\"text_exposed_show\">d ons zelfs een bezoekje brengen!</span></span></p>\r\n<p><span>Deze avond zit vol met verrassingen dus afkomen is de boodschap.&nbsp;</span></p>\r\n<p>Nog een paar belangrijke info puntjes</p>\r\n<ul>\r\n<li>wanneer: op vrijdag <strong>4 december</strong>&nbsp;</li>\r\n<li>hoelaat: van <strong>18u tot 21u</strong></li>\r\n<li>waar: <strong>Jeugdhuis Maegher Goet</strong>, Pijphoekstraat 34 9041 Oostakker</li>\r\n</ul>\r\n<div>&nbsp;</div>\r\n<p>zijn er nog vragen?</p>\r\n<p>stuur gerust een berichtje naar een van onze staf leden op facebook, wie zij zijn kan je op de <a title=\"wie is wie\" href=\"../../wieiswie/\" target=\"_blank\">wieIsWie Pagina</a>&nbsp;terug vinden.</p>\r\n<p>&nbsp;</p>\r\n<p>Graag zien we jullie allen aanwezig, tot dan en vriendelijke groeten&nbsp;</p>\r\n<p><span class=\"text_exposed_show\">De staf</span></p>', 'Sinterklaasfeest voor animatoren', '', 'publish', 'open', 'open', '', 'sinterklaasfeest_voor_animatoren', '', '', '2015-11-28 20:36:13', '0000-00-00 00:00:00', '', 0, '565a01f1-0724-46e5-90ce-79984d496259.jpg', 0, 'post', '', 0),
(452, 1, '2016-05-10 03:48:21', '2016-05-10 03:48:21', 'Welcome to WordPress. This is your first post. Edit or delete it, then start writing!', 'Hello world!', '', 'publish', 'opn', 'open', '', 'hello-world', '', '', '2016-05-10 03:48:21', '2016-05-10 03:48:21', '', 0, 'http://wp452m.a10-52-158-154.qa.plesk.ru/wordpress/?p=1', 0, 'post', '', 1),
(453, 84, '2016-06-22 14:26:45', '0000-00-00 00:00:00', '<p>Beste ouders en speelbeesten</p>\r\n<p>Omdat wij deze vraag vaak krijgen, willen nog eens meedelen dat wij <strong>nooit&nbsp;volzet</strong> zijn. We hebben <strong>altijd </strong>plaats voor iedereen die wil komen spelen! Yihaa!<br /><br />Daarbij hoef niet op voorhand aan te geven wanneer je wil komen, je kan gewoon <strong>de dag zelf</strong> kiezen of je komt of niet. <br /><br /><br /><br />&nbsp;Tot zeer binnenkort iedereen!</p>', 'Het speelakkertje heeft altijd plaats', '', 'publish', 'open', 'open', '', 'het_speelakkertje_heeft_altijd_plaats', '', '', '2016-06-22 14:26:45', '0000-00-00 00:00:00', '', 0, '576a8405-27ec-42f9-a378-33ca4d496259.jpg', 0, 'post', '', 0),
(454, 84, '2016-06-22 14:35:11', '0000-00-00 00:00:00', '<p>Ben jij iemand die graag ravot, kampen bouwt, knustselt en zich wil rot amuseren? Ben je goed met kinderen en wil je samen met hen je fantasie de vrije loop laten gaan? Zin om een bende nieuwe vrienden te maken? Zin om memorabele dagen en avonden en weekends te beleven? En om bovendien een zakcentje bij te verdienen? Word je dit jaar 15 of ben je ouder?<br /><br />Dan ben je bij het speelakkertje aan het juiste adres! Aarzel niet om ons te contacteren! Meer info over ons speelplein vind je hier op onze site of je kan mailen naar info@speelakkertje.be of eens bellen naar 04 84 94 69 95.&nbsp;<br /><br />Wie weet tot binnenkort!&nbsp;</p>', 'Word jij animator?!', '', 'publish', 'open', 'open', '', 'word_jij_animator', '', '', '2016-06-22 14:35:11', '0000-00-00 00:00:00', '', 0, '576a85ff-4d28-49bf-8516-38074d496259.jpg', 0, 'post', '', 0),
(455, 75, '2016-06-29 17:45:11', '0000-00-00 00:00:00', '<p>Deze zomer kunnen jullie van 11 juli tot 12 augustus weer terecht op \'t Speelakkertje voor een zomer vol spel en plezier! Maar, dit jaar</p>\r\n<p>zijn er ook enkele bijzondere uitstappen:</p>\r\n<p>&nbsp;</p>\r\n<p>Voor de <strong>kleuters (3 - 5 jaar)</strong>:</p>\r\n<p>- 12 juli: Pretland</p>\r\n<p>- 19 juli: Vogelopvangcentrum Merelbeke</p>\r\n<p>- 26 juli: Gravensteen</p>\r\n<p>- 2 augustus: Huis van Kina</p>\r\n<p>&nbsp;</p>\r\n<p>Voor de <strong>middengroep en tieners (6 - 14 jaar)</strong></p>\r\n<p>- 14 juli: De brandweer</p>\r\n<p>- 20 juli: Harry Maalter park</p>\r\n<p>- 28 juli: De zoo van Antwerpen</p>\r\n<p>- 4 augustus: Naar de zee</p>\r\n<p>- 11 augustus: Puyenbroeck</p>\r\n<p>&nbsp;</p>\r\n<p>Voor de tieners is er van 4 op 5 augustus een <strong>speciale tiener-tweedaagse</strong>, dus dan mogen jullie eens op \'t Speelakkertje blijven slapen!&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Wij kijken er alvast naar uit! Tot snel!</p>', 'De zomeractiviteiten!', '', 'publish', 'open', 'open', '', 'de_zomeractiviteiten', '', '', '2016-07-02 11:15:00', '0000-00-00 00:00:00', '', 0, '5773ed07-c170-466f-9667-66804d496259.png', 0, 'post', '', 0),
(456, 1, '2016-07-02 11:12:45', '2016-07-02 10:12:45', 'Hallo iedereen!\r\n\r\nOok \'t Speelakkertje gaat mee met zijn tijd! We zijn al enkele jaren actief op <strong>Facebook</strong> om jullie op de hoogte te houden van het reilen en zeilen van wat er <img class=\"size-medium wp-image-214 alignright\" src=\"http://beta.speelakkertje.be/wordpress/wp-content/uploads/2016/07/IMG_6037-300x200.jpg\" alt=\"IMG_6037\" width=\"300\" height=\"200\" />allemaal op ons speelplein gebeurt. Wil je ons daar ook volgen? Like dan vliegensvlug onze pagina: https://www.facebook.com/speelakkertje .\r\n\r\nNaast Facebook zijn we ook actief op <strong>Instagram</strong>, waar we onze mooiste foto\'s met jullie delen. Je kan ons daar ook volgen via https://www.instagram.com/speelpleinspeelakkertje .\r\n\r\nEn natuurlijk blijven we ook alles communiceren via <strong>onze website</strong>.\r\n\r\nTot zeeeeer binnenkort!', 'Volg ons ook via de sociale media', '', 'publish', 'open', 'open', '', 'volg_ons_ook_via_de_sociale_media', '', '', '2016-07-23 18:26:05', '2016-07-23 16:26:05', '', 0, 'http://5777858d-0204-41b7-8ffd-17ce4d496259.jpeg', 0, 'post', '', 0),
(457, 1, '2016-07-05 14:06:07', '2016-07-05 12:06:07', 'Hallo speelpleiners!\r\n\r\nOver een kleine week gaat ons speelparadijs met het thema  * * * * * * open! Joepie!\r\n\r\nHierbij laten we jullie al even binnenkijken in onze opbouw en de transformatie van school naar speelplein.\r\n\r\nTot volgende weeeek!', 'De opbouw vordert!', '', 'publish', 'open', 'open', '', 'de-opbouw-vordert', '', '', '2016-07-23 18:27:50', '2016-07-23 16:27:50', '', 0, 'http://beta.speelakkertje.be/wordpress/?p=456', 0, 'post', '', 0),
(458, 1, '2016-07-06 14:07:00', '2016-07-06 12:07:00', '<div data-block=\"true\" data-editor=\"37f8r\" data-offset-key=\"dmplr-0-0\">\r\n<div class=\"_1mf _1mj\" data-offset-key=\"dmplr-0-0\"><span data-offset-key=\"dmplr-0-0\">Dag Iedereen,</span></div>\r\n<div class=\"_1mf _1mj\" data-offset-key=\"dmplr-0-0\"><span data-offset-key=\"dmplr-0-0\"> </span></div>\r\n<div class=\"_1mf _1mj\" data-offset-key=\"dmplr-0-0\"><span data-offset-key=\"dmplr-0-0\">Morgen (woensdag 6 juli ) tussen 16u en 17u en vrijdag 8 juli tussen 16u en 17u kan u bij de groene poort al jetons aankopen voor dit speelpleinjaar.</span></div>\r\n</div>\r\n<div data-block=\"true\" data-editor=\"37f8r\" data-offset-key=\"flrrc-0-0\">\r\n<div class=\"_1mf _1mj\" data-offset-key=\"flrrc-0-0\"><span data-offset-key=\"flrrc-0-0\"> </span></div>\r\n</div>\r\n<div data-block=\"true\" data-editor=\"37f8r\" data-offset-key=\"1vqgm-0-0\">\r\n<div class=\"_1mf _1mj\" data-offset-key=\"1vqgm-0-0\"><span data-offset-key=\"1vqgm-0-0\">Een rode jeton kost DRIE euro en is voor een halve dag</span></div>\r\n</div>\r\n<div data-block=\"true\" data-editor=\"37f8r\" data-offset-key=\"e4e92-0-0\">\r\n<div class=\"_1mf _1mj\" data-offset-key=\"e4e92-0-0\"><span data-offset-key=\"e4e92-0-0\">Een oranje jeton kost ZEVEN euro en is voor een volle dag</span></div>\r\n</div>\r\n<div data-block=\"true\" data-editor=\"37f8r\" data-offset-key=\"eutrp-0-0\">\r\n<div class=\"_1mf _1mj\" data-offset-key=\"eutrp-0-0\"><span data-offset-key=\"eutrp-0-0\"> </span></div>\r\n</div>\r\n<div data-block=\"true\" data-editor=\"37f8r\" data-offset-key=\"8sard-0-0\">\r\n<div class=\"_1mf _1mj\" data-offset-key=\"8sard-0-0\"><span data-offset-key=\"8sard-0-0\">Liefst zo gepast mogelijk betalen.</span></div>\r\n</div>\r\n<div data-block=\"true\" data-editor=\"37f8r\" data-offset-key=\"9jnae-0-0\">\r\n<div class=\"_1mf _1mj\" data-offset-key=\"9jnae-0-0\"><span data-offset-key=\"9jnae-0-0\"> </span></div>\r\n</div>\r\n<div data-block=\"true\"