(459, 1, '2016-07-12 14:07:34', '2016-07-12 12:07:34', '!!! ICT-PROBLEEM:\r\n\r\nWegens problemen met onze site kan u niet meer online inschrijven. U kan wel het papieren inschrijvingsformulier afprinten, invullen en de dag zelf meebrengen.\r\n\r\nOnze excuses voor het ongemak! Men zegge het door!', 'Inschrijvingen kunnen niet meer online!', '', 'publish', 'open', 'open', '', 'inschrijvingen-kunnen-niet-meer-online', '', '', '2016-07-23 18:28:20', '2016-07-23 16:28:20', '', 0, 'http://beta.speelakkertje.be/wordpress/?p=461', 0, 'post', '', 0),
