(462, 1, '2016-07-13 14:10:06', '2016-07-13 12:10:06', 'Deze week gaan de middengroep en kleuters op uitstap:\r\n\r\n&nbsp;\r\n\r\nLet op: De plaatsen zijn beperkt!\r\n\r\n&nbsp;\r\n\r\n<strong>Middengroep en tieners</strong>\r\n\r\n<em>Uitstap naar de brandweer : heel de dag: donderdag 14 juli</em>\r\n\r\n<strong>Kleuter</strong>\r\n\r\n<em>Uitstap naar pretland : namiddag : donderdag 14 juli </em>', 'DONDERDAG UITSTAPPEN!', '', 'publish', 'open', 'open', '', 'donderdag-uitstappen', '', '', '2016-07-23 18:29:11', '2016-07-23 16:29:11', '', 0, 'http://beta.speelakkertje.be/wordpress/?p=468', 0, 'post', '', 0),
