(464, 1, '2016-07-18 14:12:16', '2016-07-18 12:12:16', 'Beste ouders en speelkameraden\r\n\r\n&nbsp;\r\n\r\nAls één van de enige Gentse Speelpleinen zijn wij open tijdens de Gentse Feesten ! Zoekt jouw kapoen nog een speelplaats ? Dan kunnen jullie terecht bij Speelplein \'t Speelakkertje van maandag tot vrijdag, en dat telkens van 8u - 17u30. Je kleine spruit afzetten kan elke dag tussen 8u en 9u en tussen 13u30 en 14u.\r\n\r\nTot binnenkort !\r\nSpeelplein \'t Speelakkertje.', 'Wij zijn de hele Gentse Feesten open!', '', 'publish', 'open', 'open', '', 'wij-zijn-de-hele-gentse-feesten-open', '', '', '2016-07-23 18:29:54', '2016-07-23 16:29:54', '', 0, 'http://beta.speelakkertje.be/wordpress/?p=473', 0, 'post', '', 0),
