(473, 1, '2016-07-23 18:25:26', '2016-07-23 16:25:26', '<div data-block=\"true\" data-editor=\"37f8r\" data-offset-key=\"dmplr-0-0\">\r\n<div class=\"_1mf _1mj\" data-offset-key=\"dmplr-0-0\"><span data-offset-key=\"dmplr-0-0\">Dag Iedereen,</span></div>\r\n<div class=\"_1mf _1mj\" data-offset-key=\"dmplr-0-0\"><span data-offset-key=\"dmplr-0-0\"> </span></div>\r\n<div class=\"_1mf _1mj\" data-offset-key=\"dmplr-0-0\"><span data-offset-key=\"dmplr-0-0\">Morgen (woensdag 6 juli ) tussen 16u en 17u en vrijdag 8 juli tussen 16u en 17u kan u bij de groene poort al jetons aankopen voor dit speelpleinjaar.</span></div>\r\n</div>\r\n<div data-block=\"true\" data-editor=\"37f8r\" data-offset-key=\"flrrc-0-0\">\r\n<div class=\"_1mf _1mj\" data-offset-key=\"flrrc-0-0\"><span data-offset-key=\"flrrc-0-0\"> </span></div>\r\n</div>\r\n<div data-block=\"true\" data-editor=\"37f8r\" data-offset-key=\"1vqgm-0-0\">\r\n<div class=\"_1mf _1mj\" data-offset-key=\"1vqgm-0-0\"><span data-offset-key=\"1vqgm-0-0\">Een rode jeton kost DRIE euro en is voor een halve dag</span></div>\r\n</div>\r\n<div data-block=\"true\" data-editor=\"37f8r\" data-offset-key=\"e4e92-0-0\">\r\n<div class=\"_1mf _1mj\" data-offset-key=\"e4e92-0-0\"><span data-offset-key=\"e4e92-0-0\">Een oranje jeton kost ZEVEN euro en is voor een volle dag</span></div>\r\n</div>\r\n<div data-block=\"true\" data-editor=\"37f8r\" data-offset-key=\"eutrp-0-0\">\r\n<div class=\"_1mf _1mj\" data-offset-key=\"eutrp-0-0\"><span data-offset-key=\"eutrp-0-0\"> </span></div>\r\n</div>\r\n<div data-block=\"true\" data-editor=\"37f8r\" data-offset-key=\"8sard-0-0\">\r\n<div class=\"_1mf _1mj\" data-offset-key=\"8sard-0-0\"><span data-offset-key=\"8sard-0-0\">Liefst zo gepast mogelijk betalen.</span></div>\r\n</div>\r\n<div data-block=\"true\" data-editor=\"37f8r\" data-offset-key=\"9jnae-0-0\">\r\n<div class=\"_1mf _1mj\" data-offset-key=\"9jnae-0-0\"><span data-offset-key=\"9jnae-0-0\"> </span></div>\r\n</div>\r\n<div data-block=\"true\" data-editor=\"37f8r\" data-offset-key=\"asflo-0-0\">\r\n<div class=\"_1mf _1mj\" data-offset-key=\"asflo-0-0\"><span data-offset-key=\"asflo-0-0\">Tot binnenkort!</span></div>\r\n</div>', 'Jetons kopen voor de zomer', '', 'inherit', 'closed', 'closed', '', '458-revision-v1', '', '', '2016-07-23 18:25:26', '2016-07-23 16:25:26', '', 458, 'http://speelakkertje.be/458-revision-v1/', 0, 'revision', '', 0),
(474, 1, '2016-07-23 18:25:48', '2016-07-23 16:25:48', 'Hallo speelpleiners!\r\n\r\nOver een kleine week gaat ons speelparadijs met het thema  * * * * * * open! Joepie!\r\n\r\nHierbij laten we jullie al even binnenkijken in onze opbouw en de transformatie van school naar speelplein.\r\n\r\nTot volgende weeeek!', 'De opbouw vordert!', '', 'inherit', 'closed', 'closed', '', '457-revision-v1', '', '', '2016-07-23 18:25:48', '2016-07-23 16:25:48', '', 457, 'http://speelakkertje.be/457-revision-v1/', 0, 'revision', '', 0),
(475, 1, '2016-07-23 18:26:05', '2016-07-23 16:26:05', 'Hallo iedereen!\r\n\r\nOok \'t Speelakkertje gaat mee met zijn tijd! We zijn al enkele jaren actief op <strong>Facebook</strong> om jullie op de hoogte te houden van het reilen en zeilen van wat er <img class=\"size-medium wp-image-214 alignright\" src=\"http://beta.speelakkertje.be/wordpress/wp-content/uploads/2016/07/IMG_6037-300x200.jpg\" alt=\"IMG_6037\" width=\"300\" height=\"200\" />allemaal op ons speelplein gebeurt. Wil je ons daar ook volgen? Like dan vliegensvlug onze pagina: https://www.facebook.com/speelakkertje .\r\n\r\nNaast Facebook zijn we ook actief op <strong>Instagram</strong>, waar we onze mooiste foto\'s met jullie delen. Je kan ons daar ook volgen via https://www.instagram.com/speelpleinspeelakkertje .\r\n\r\nEn natuurlijk blijven we ook alles communiceren via <strong>onze website</strong>.\r\n\r\nTot zeeeeer binnenkort!', 'Volg ons ook via de sociale media', '', 'inherit', 'closed', 'closed', '', '456-revision-v1', '', '', '2016-07-23 18:26:05', '2016-07-23 16:26:05', '', 456, 'http://speelakkertje.be/456-revision-v1/', 0, 'revision', '', 0),
