(480, 1, '2016-07-23 20:08:39', '2016-07-23 18:08:39', '<div id=\"column_right\" style=\"width: 30%; float: right; padding: 5%;\">\n<div class=\"side_menu\">\n<h2>Praktische informatie</h2>\n<ul>\n 	<li><a href=\"http://speelakkertje.be/onze-visie/\">Onze visie</a></li>\n 	<li><a href=\"/praktisch/onze_werking\">Onze werking</a></li>\n 	<li><a href=\"/praktisch/een_speelpleindag\">Een speelpleindag</a></li>\n 	<li><a href=\"http://speelakkertje.be/kledij/\">Kledij</a></li>\n 	<li><a href=\"http://speelakkertje.be/animatorenploeg/\">De animatorenploeg</a></li>\n 	<li><a href=\"http://speelakkertje.be/animator-worden/\">Animator worden</a></li>\n</ul>\n</div>\n</div>\n<div id=\"main_left\">\n<h1>Praktisch</h1>\nWe zijn een toffe groep van ongeveer 45 enthousiaste animatoren die al negentien jaar lang de kinderen in en rond Oostakker ongelooflijk veel speelplezier bieden tijdens de zomervakantie!  Met een gemiddelde opkomst van zo’n 120 pagadders per dag zijn we een van de grootste, (en ongetwijfeld één van de leukste) speelpleinwerkingen in Gent!\n\nJe vindt ons op de terreinen van <strong>EDUGO campus De Toren</strong>, <span style=\"text-decoration: underline;\">Sint-Jozefstraat 10 in Oostakker</span>.  De ingang van het speelplein vind je achter de glazen deur, bereikbaar langs de dreef met kiezelsteentjes.\n\nAls je met de fiets naar het plein komt, is er ook een fietsenstalling voorzien speciaal voor jullie. Jullie kunnen daar de fietsen plaatsen en tijdens het speelplein gaat de stalling op slot om diefstal te voorkomen.\n\n[caption id=\"attachment_400\" align=\"alignleft\" width=\"300\"]<img class=\"wp-image-400 size-medium\" src=\"http://beta.speelakkertje.be/wordpress/wp-content/uploads/2016/07/Toren-300x200.jpg\" alt=\"Toren\" width=\"300\" height=\"200\" /> Bron: http://cms.edugo.be/[/caption]\n\n</div>', 'Praktisch', '', 'inherit', 'closed', 'closed', '', '110-autosave-v1', '', '', '2016-07-23 20:08:39', '2016-07-23 18:08:39', '', 110, 'http://speelakkertje.be/110-autosave-v1/', 0, 'revision', '', 0),
(481, 1, '2016-07-23 20:09:23', '2016-07-23 18:09:23', '<div id=\"column_right\" style=\"width: 30%; float: right; padding: 5%;\">\r\n<div class=\"side_menu\">\r\n<h2>Praktische informatie</h2>\r\n<ul>\r\n 	<li><a href=\"http://speelakkertje.be/onze-visie/\">Onze visie</a></li>\r\n 	<li><a href=\"http://speelakkertje.be/onze-werking/\">Onze werking</a></li>\r\n 	<li><a href=\"http://speelakkertje.be/een-speelpleindag/\">Een speelpleindag</a></li>\r\n 	<li><a href=\"http://speelakkertje.be/kledij/\">Kledij</a></li>\r\n 	<li><a href=\"http://speelakkertje.be/animatorenploeg/\">De animatorenploeg</a></li>\r\n 	<li><a href=\"http://speelakkertje.be/animator-worden/\">Animator worden</a></li>\r\n 	<li><a href=\"http://speelakkertje.be/de-staf/\">onze staf</a></li>\r\n 	<li><a href=\"http://speelakkertje.be/wie-is-wie/\">wie is wie</a></li>\r\n</ul>\r\n</div>\r\n</div>\r\n<div id=\"main_left\">\r\n<h1>Praktisch</h1>\r\nWe zijn een toffe groep van ongeveer 45 enthousiaste animatoren die al negentien jaar lang de kinderen in en rond Oostakker ongelooflijk veel speelplezier bieden tijdens de zomervakantie!  Met een gemiddelde opkomst van zo’n 120 pagadders per dag zijn we een van de grootste, (en ongetwijfeld één van de leukste) speelpleinwerkingen in Gent!\r\n\r\nJe vindt ons op de terreinen van <strong>EDUGO campus De Toren</strong>, <span style=\"text-decoration: underline;\">Sint-Jozefstraat 10 in Oostakker</span>.  De ingang van het speelplein vind je achter de glazen deur, bereikbaar langs de dreef met kiezelsteentjes.\r\n\r\nAls je met de fiets naar het plein komt, is er ook een fietsenstalling voorzien speciaal voor jullie. Jullie kunnen daar de fietsen plaatsen en tijdens het speelplein gaat de stalling op slot om diefstal te voorkomen.\r\n\r\n[caption id=\"attachment_400\" align=\"alignleft\" width=\"300\"]<img class=\"wp-image-400 size-medium\" src=\"http://beta.speelakkertje.be/wordpress/wp-content/uploads/2016/07/Toren-300x200.jpg\" alt=\"Toren\" width=\"300\" height=\"200\" /> Bron: http://cms.edugo.be/[/caption]\r\n\r\n</div>', 'Praktisch', '', 'inherit', 'closed', 'closed', '', '110-revision-v1', '', '', '2016-07-23 20:09:23', '2016-07-23 18:09:23', '', 110, 'http://speelakkertje.be/110-revision-v1/', 0, 'revision', '', 0),
(482, 1, '2016-07-23 20:12:27', '2016-07-23 18:12:27', '<h4>Op een speelpleindag</h4>\r\n<strong>\r\n</strong>Vuile, natte, vieze kleren = een dag waarop kinderen zich geamuseerd hebben !\r\nDoe je kind dus<em> niet</em> zijn mooiste zondagskostuum aan, niet zijn nieuwste schoenen... want deze kunnen wel eens vuil worden !\r\n<span style=\"text-decoration: underline;\">Reservekledij</span> mag altijd meegegeven worden in een rugzakje. Dit is aangeraden op een warme dag net zoals <span style=\"text-decoration: underline;\">zwemgerief</span>  !\r\n<h4><strong>Verloren kledij</strong></h4>\r\n<strong>\r\n</strong>Elke avond verzamelen we alle kledij die verloren ging gedurende de dag.\r\nDeze kledij wordt steeds aan de uitgang van het speelplein op een tafel open gelegd of in een bak bewaard.\r\nHet is sterk aangeraden de kledij te voorzien met de naam van het kind.\r\nBen je na de zomer nog steeds kledij kwijt ? Neem dan zeker contact op met ons via:<span style=\"text-decoration: underline;\"> info@speelakkertje.be</span>\r\n<h4><strong>Kledij kopen</strong></h4>\r\n<strong><img class=\"size-medium wp-image-429 alignright\" src=\"http://beta.speelakkertje.be/wordpress/wp-content/uploads/2016/07/IMG_6074-300x200.jpg\" alt=\"prijslijst t-shirts\" width=\"300\" height=\"200\" />\r\n</strong><em>Animatoren: </em>Elk jaar ontwerpen we een nieuwe T-shirt in het thema van de zomer, dit jaar is ons<strong> thema: Zoo</strong>\r\nAnimatoren kunnen deze T-shirt kopen, of krijgen een T-shirt indien ze <span style=\"text-decoration: underline;\">minimum 2 weken</span> speelplein geven in één zomer. Ook kunnen animatoren onze trui kopen.\r\nDeze kan je gratis krijgen als je 3 of meer weken speelplein geeft.\r\n\r\n<em>Kinderen:</em> De laatste jaren kunnen ook de kinderen de T-shirt in het thema kopen.\r\nVoor slechts €10 zijn deze iedere avond te koop aan de uitgang.\r\nOok de T-shirts van voorbije jaren zijn dan te koop voor €5.\r\n<h4>Bekijk alle t-shirts hieronder door te klikken op de foto!</h4>\r\n[Best_Wordpress_Gallery id=\"1\" gal_title=\"t-shirts\"]\r\n<h4></h4>', 'Kledij op het speelplein', '', 'publish', 'closed', 'closed', '', 'kledij-op-het-speelplein', '', '', '2016-07-23 21:32:04', '2016-07-23 19:32:04', '', 0, 'http://speelakkertje.be/?page_id=482', 0, 'page', '', 0),
