(527, 1, '2016-07-24 15:18:30', '2016-07-24 13:18:30', 'De staf bestaat uit een groepje meer ervaren animatoren die het plein draaiende houdt.  Ze komen maandelijks samen tijdens een stafvergadering om alles te bespreken dat te maken heeft met het speelplein (beslissen over de centen, organiseren van animatorenactiviteiten, aanvragen van subsidies, verzorgen van de PR van het speelplein en zo zorgen dat er kindjes en animatoren zijn, …)  Elk van hen trekt daarnaast een of meerdere werkgroepen, waar je als animator aan kan deelnemen en zo je eigen stempel op de werking kan drukken!\r\n\r\nStaflid kan je worden vanaf het jaar dat je achttien wordt en je moet minstens één zomer als animator actief geweest zijn op het speelplein.\r\n\r\nDe huidige staf kent de volgende samenstelling:\r\n<ul>\r\n 	<li>Gaëtan Rubbrecht (voorzitter)</li>\r\n 	<li>Lisa De Clercq (ondervoorzitter)</li>\r\n 	<li>Astrid De Maeyer</li>\r\n 	<li>Eline Lutters</li>\r\n 	<li>Jirke Verhaeven</li>\r\n 	<li>Katoo Vael</li>\r\n 	<li>Elke Bouckaert</li>\r\n 	<li>Gwyneth De Grieve</li>\r\n</ul>', 'De staf', '', 'inherit', 'closed', 'closed', '', '84-revision-v1', '', '', '2016-07-24 15:18:30', '2016-07-24 13:18:30', '', 84, 'http://speelakkertje.be/84-revision-v1/', 0, 'revision', '', 0),
