(533, 1, '2016-07-24 18:09:10', '2016-07-24 16:09:10', '<strong>Eerst en vooral hebben we altijd plaats voor al u kinderen, we zitten nooit volzet en geven elk kind een prachtige speeldag. </strong>\r\n\r\nEven een kort woordje uitleg over hoe ons nieuw systeem werkt:\r\n\r\nDe volgende stappen zijn <strong>NIET VERPLICHT, </strong>dit kan ook <strong>ter plaatsen gebeuren</strong> via een inschrijvingsfiche. We hebben gekozen voor een vast login systeem waar je je persoonlijke gegevens en de gegevens van je kind kan invullen en ook kan veranderen achteraf.\r\n\r\nMocht je in de zomer of in het jaar verhuizen kan dat door jullie zelf ingevuld worden zonder de hele inschrijving opnieuw te moeten doen.\r\n\r\nEr is een speciale button die je vraagt of je kind dit jaar komt of niet, <strong>als u hier neen aanduidt, word uw kind niet toegevoegd aan de inschrijvingen</strong>.\r\n\r\nNa het einde van de zomer zetten we de actie actief bij iedereen op \"neen\". Er volgt dan een mail waarin er gevraagd wordt of uw kind het volgende jaar opnieuw komt. U kan dan gewoon weer \"ja\" aanduiden zonder uw persoonlijke gegevens en de gegevens van uw kind kwijt te raken.\r\n\r\n<strong>Hoe maakt u een account aan?</strong>\r\n\r\nEerst moet u een account aan maken door op de link <span style=\"text-decoration: underline;\">login</span> te duwen, daar vragen we om standaard gegevens:\r\n<ul>\r\n 	<li>uw emailadres</li>\r\n 	<li>een wachtwoord</li>\r\n</ul>\r\nDaarna vragen we om u persoonlijke gegevens in te vullen zoals naam, telefoon nummer en adres. Deze gegevens kunnen ook enkel door de <span class=\"s1\">pleinverantwoordelijken gezien worden. Tot slot moet u nog de gegevens van uw kinderen invullen en dan is de inschrijving van uw kind voltooid.</span>\r\n\r\nVanaf dan ziet u de gegevens van uw kind staan bij \"mijn kind(eren)\", zo weet u zeker dat uw kind goed ingeschreven is en bij ons geregistreerd is.\r\n\r\nAan het begin van de zomer zal <strong>als u geklikt hebt op \'mijn kind komt dit jaar\'</strong> een pasje klaar liggen voor uw kind(eren).\r\n\r\nHebt u eventueel verdere vragen, stuur dan gerust een mail naar <span style=\"text-decoration: underline;\">info@speelakkertje.be</span>\r\n\r\nWaar wacht u nog op en <a href=\"http://speelakkertje.be/aanmelden/\">maak een account aan</a>', 'Info inschrijvingen', '', 'inherit', 'closed', 'closed', '', '94-revision-v1', '', '', '2016-07-24 18:09:10', '2016-07-24 16:09:10', '', 94, 'http://speelakkertje.be/94-revision-v1/', 0, 'revision', '', 0),
