(565, 1, '2016-07-27 14:48:05', '2016-07-27 12:48:05', '- De kinderfuif vanavond gaat NIET door (wegens te weinig respons).\r\n- Er zijn nog 5 plaatsen over om morgen naar de zoo van Antwerpen te gaan (6-14 jaar). Inschrijven kan dus nog!\r\n- Volgende week (4-5 augustus) is er een supertoffe tiener tweedaagse op het speelplein (9 - 14 jaar). Inschrijven hiervoor is wel noodzakelijk.\r\n- EXTRA: morgen en vrijdag zijn er nog steeds springkastelen! Joepie! <a class=\"_58cn\" href=\"https://www.facebook.com/hashtag/fun?source=feed_text&amp;story_id=1279475885410571\" data-ft=\"{&quot;tn&quot;:&quot;*N&quot;,&quot;type&quot;:104}\"><span class=\"_58cl\">‪#‎</span><span class=\"_58cm\">fun‬</span></a><a class=\"_58cn\" href=\"https://www.facebook.com/hashtag/speelakkertjeisdemax?source=feed_text&amp;story_id=1279475885410571\" data-ft=\"{&quot;tn&quot;:&quot;*N&quot;,&quot;type&quot;:104}\"><span class=\"_58cl\">‪#‎</span><span class=\"_58cm\">speelakkertjeisdemax‬</span></a>', 'Informatie voor deze en volgende week!', '', 'publish', 'open', 'open', '', 'informatie-voor-deze-en-volgende-week', '', '', '2016-07-27 14:48:05', '2016-07-27 12:48:05', '', 0, 'http://speelakkertje.be/?p=565', 0, 'post', '', 0),
