(585, 6, '2016-08-07 15:37:22', '2016-08-07 13:37:22', 'Beste ouders,\r\n\r\nMaandag start de aller laatste week van deze speelpleinzomer. Jullie kunnen dus nog voor 1 week vol speelplezier en fun bij ons terecht. Ook deze laatste week staat er nog een uitstap op de planning. Kinderen tussen 6 en 14 jaar kunnen op donderdag 11 augustus een dagje naar de Puyenbroeck gaan. Meer informatie hierover vindt u terug onder documenten, brief week 5. Verder zullen er deze week ook weer springkastelen zijn! Dus zeker komen!\r\n\r\nAangezien het onze laatste week is, zullen er op vrijdag 12 augustus geen hotdogs meer verkocht worden. Voorzie dus zeker een lunchpakket indien uw zoon of dochter een volledige dag komt spelen.\r\n\r\nTot maandag!\r\n\r\nGroetjes De Staf!', 'Informatie week 5', '', 'publish', 'open', 'open', '', 'informatie-week-5', '', '', '2016-08-07 15:39:01', '2016-08-07 13:39:01', '', 0, 'http://speelakkertje.be/?p=585', 0, 'post', '', 0),
