(591, 6, '2016-08-10 17:06:24', '2016-08-10 15:06:24', '<strong>Beste ouders, </strong>\r\n<strong>Morgen gaat onze uitstap naar puyenbroeck door. </strong>\r\n<strong>Wie nog niet is ingeschreven, komt morgen best om 8u naar het speelplein. Er zijn slechts nog maar acht plaatsen vrij, vol is vol! </strong>\r\n<strong>Wat mag je niet vergeten? Lunchpakket, buzzypas, zwemkledij, handdoek en je regenjas. We zijn terug om half 6 !\r\nJe vindt de brief ook terug bij bestanden op deze site.</strong>\r\n<div class=\"text_exposed_show\">\r\n\r\n<strong>Uiteraard is het speelplein gewoon open voor alle kinderen die niet mee gaan op uitstap !</strong>\r\n\r\n</div>', 'Morgen: uitstap naar puyenbroeck', '', 'publish', 'open', 'open', '', 'morgen-uitstap-naar-puyenbroeck', '', '', '2016-09-28 09:34:51', '2016-09-28 07:34:51', '', 0, 'http://speelakkertje.be/?p=591', 0, 'post', '', 0),
(592, 6, '2016-08-10 17:06:24', '2016-08-10 15:06:24', '<strong>Beste ouders, </strong>\r\n<strong>Morgen gaat onze uitstap naar puyenbroeck door. </strong>\r\n<strong>Wie nog niet is ingeschreven, komt morgen best om 8u naar het speelplein. Er zijn slechts nog maar acht plaatsen vrij, vol is vol! </strong>\r\n<strong>Wat mag je niet vergeten? Lunchpakket, buzzypas, zwemkledij, handdoek en je regenjas. We zijn terug om half 6 !\r\nJe vindt de brief ook terug bij bestanden op deze site.</strong>\r\n<div class=\"text_exposed_show\">\r\n\r\n<strong>Uiteraard is het speelplein gewoon open voor alle kinderen die niet mee gaan op uitstap !</strong>\r\n\r\n</div>', 'Morgen: uitstap naar puyenbroeck', '', 'inherit', 'closed', 'closed', '', '591-revision-v1', '', '', '2016-08-10 17:06:24', '2016-08-10 15:06:24', '', 591, 'http://speelakkertje.be/591-revision-v1/', 0, 'revision', '', 0),
