(612, 1, '2016-09-30 19:42:15', '2016-09-30 17:42:15', 'De staf bestaat uit een groepje meer ervaren animatoren die het plein draaiende houdt.  Ze komen maandelijks samen tijdens een stafvergadering om alles te bespreken dat te maken heeft met het speelplein (beslissen over de centen, organiseren van animatorenactiviteiten, aanvragen van subsidies, verzorgen van de PR van het speelplein en zo zorgen dat er kindjes en animatoren zijn, …)  Elk van hen trekt daarnaast een of meerdere werkgroepen, waar je als animator aan kan deelnemen en zo je eigen stempel op de werking kan drukken!\n\nStaflid kan je worden vanaf het jaar dat je achttien wordt en je moet minstens één zomer als animator actief geweest zijn op het speelplein.\n\nDe huidige staf kent de volgende samenstelling:\n<ul>\n 	<li>Gaëtan Rubbrecht (voorzitter)</li>\n 	<li>Katoo Vael (Vice-voorziter)</li>\n 	<li>Jeroen Dellaert</li>\n 	<li>Gwyneth Degrieve</li>\n 	<li>Imke Goetschalckx</li>\n 	<li>Gwen De Meulemeester</li>\n 	<li>Nathan Steyaert</li>\n 	<li>Axel Caspeele</li>\n 	<li>Katoo Vael</li>\n 	<li>Gwyneth De Grieve</li>\n</ul>', 'De staf', '', 'inherit', 'closed', 'closed', '', '84-autosave-v1', '', '', '2016-09-30 19:42:15', '2016-09-30 17:42:15', '', 84, 'http://speelakkertje.be/84-autosave-v1/', 0, 'revision', '', 0),
