(615, 1, '2016-09-30 19:43:24', '2016-09-30 17:43:24', 'De staf bestaat uit een groepje meer ervaren animatoren die het plein draaiende houdt.  Ze komen maandelijks samen tijdens een stafvergadering om alles te bespreken dat te maken heeft met het speelplein (beslissen over de centen, organiseren van animatorenactiviteiten, aanvragen van subsidies, verzorgen van de PR van het speelplein en zo zorgen dat er kindjes en animatoren zijn, …)  Elk van hen trekt daarnaast een of meerdere werkgroepen, waar je als animator aan kan deelnemen en zo je eigen stempel op de werking kan drukken!\r\n\r\nStaflid kan je worden vanaf het jaar dat je achttien wordt en je moet minstens één zomer als animator actief geweest zijn op het speelplein.\r\n\r\nDe huidige staf kent de volgende samenstelling:<img class=\" wp-image-614 alignright\" src=\"http://speelakkertje.be/wp-content/uploads/2016/07/IMG_0425_2-300x200.jpg\" alt=\"img_0425_2\" width=\"425\" height=\"283\" />\r\n<ul>\r\n 	<li>Gaëtan Rubbrecht (voorzitter)</li>\r\n 	<li>Katoo Vael (Vice-voorziter)</li>\r\n 	<li>Jeroen Dellaert (ICT verandwoordelijken)</li>\r\n 	<li>Gwyneth Degrieve</li>\r\n 	<li>Imke Goetschalckx</li>\r\n 	<li>Gwen De Meulemeester</li>\r\n 	<li>Nathan Steyaert</li>\r\n 	<li>Axel Caspeele</li>\r\n 	<li>Gwyneth De Grieve</li>\r\n</ul>', 'De staf', '', 'inherit', 'closed', 'closed', '', '84-revision-v1', '', '', '2016-09-30 19:43:24', '2016-09-30 17:43:24', '', 84, 'http://speelakkertje.be/84-revision-v1/', 0, 'revision', '', 0),
