(636, 14, '2016-10-16 21:00:02', '0000-00-00 00:00:00', 'De dagen worden korter, het weer wordt kouder... Ja, de winter is in aantocht, en hoe kan je dat nu beter vieren dan met een groot winterfeest! Op zaterdag 12 november organiseren wij een heuse kinderdisco tussen 16:00 en 19:00. Trek dus maar alvast je mooiste winterkostuum aan en dan bouwen we een feestje. Hiervoor vragen wij 4 euro en in ruil krijgt uw kind een onvergetelijke avond met een hapje en een drankje. Wij toveren Edugo Campus de Toren (Sint-Jozefstraat 10, 9041 Oostakker) helemaal om tot ons eigen Winterwonderland.\n\nJij komt toch ook?\n\n&nbsp;', 'Kinderdisco: Winterwonderland', '', 'draft', 'open', 'open', '', '', '', '', '2016-10-16 21:00:02', '2016-10-16 19:00:02', '', 0, 'http://speelakkertje.be/?p=636', 0, 'post', '', 0),
