(675, 1, '2017-01-28 16:45:02', '2017-01-28 15:45:02', '<h2>Veelgestelde vragen!</h2>\r\nVindt u iets niet direct terug of is iets niet duidelijk? Hieronder vindt u een overzicht van de meest gestelde vragen.\r\n\r\n&nbsp;\r\n\r\n<strong>Wat zijn de openingsuren?</strong>\r\n<em>\"Inschrijven tussen 8u en 9u in de voormiddag en 13u30 en 14u in de voormiddag. Kinderen ophalen tussen 12u en 12u15 (indien een halve dag) en \'s avonds van 16u30 tot en met 17u30.\"</em>\r\n\r\n<strong>Hoe zit het met het eten?</strong>\r\n<em>\"Wie een volledige dag bij ons komt spelen, neemt een lunchpakketje mee en iets om te drinken. Wij geven natuurlijk een 10- en 4-uurtje en de kinderen hebben altijd toegang tot drinkwater.\"</em>\r\n\r\n<strong>Waren er geen hotdogs?</strong>\r\n\"<em>Iedere vrijdag kunnen er hotdogs gekocht worden aan 1 euro. Deze gelden als middagmaal, dus uw kind hoeft dan geen lunchpakket mee te doen! Je kan dit de dag zelf kopen.</em>\"\r\n\r\n<strong>Kan ik mijn kind voor verschillende dagen inschrijven?\r\n</strong>\" <em>Je kan zelf kiezen wanneer je kind naar het speelplein komt. Dit kan een hele week, één dag of verschillende niet-opeenvolgende dagen zijn. Je moet niet vooraf ingeschreven zijn! Voor ons is het wel handiger als je vooraf geregistreerd bent op onze website, maar dit is zeker geen vereiste!</em>\"\r\n\r\nHebt u nog een vraag of is nog iets niet duidelijk?\r\nStuur ze gerust door naar speelplein@speelakkertje.be\r\nU krijgt zo spoedig mogelijk antwoord en het antwoord zal ook hier te vinden zijn', 'F.A.Q.', '', 'publish', 'closed', 'closed', '', 'f-a-q', '', '', '2017-01-29 14:52:16', '2017-01-29 13:52:16', '', 0, 'http://speelakkertje.be/?page_id=675', 0, 'page', '', 0),
