(684, 10, '2017-01-29 14:56:55', '2017-01-29 13:56:55', '<div class=\"_1dwg _1w_m _2ph_\">\n<div id=\"js_qk\" class=\"_5pbx userContent\">\n<div id=\"id_5878d1e28c7b95795871564\" class=\"text_exposed_root text_exposed\">\n\nLieve mama\'s, papa\'s, speelvogels en sympathisanten <img class=\"img\" src=\"https://www.facebook.com/images/emoji.php/v6/ff0/2/16/1f603.png\" alt=\"\" width=\"16\" height=\"16\" /> <img class=\"img\" src=\"https://www.facebook.com/images/emoji.php/v6/ff0/2/16/1f603.png\" alt=\"\" width=\"16\" height=\"16\" />\n\nJe kan je vanaf <strong>nu</strong> registreren of <strong>inschrijven</strong> voor het speelplein, dit doe je zo:\n<div class=\"text_exposed_show\">\n\n1. Je hebt al een account aangemaakt voor je kinderen via <a href=\"http://speelakkertje.be/info-inschrijvingen/\" target=\"_blank\" rel=\"nofollow\">http://speelakkertje.be/info-inschrijvingen/</a> ? Je kan via je account <strong>HERBEVESTIGEN</strong> dat je komt in 2017 of je gegevens aanpassen indien nodig.\n\n2. Je hebt nog geen account? Maak dit dan aan via <a href=\"http://speelakkertje.be/info-inschrijvingen/\" target=\"_blank\" rel=\"nofollow\">http://speelakkertje.be/info-inschrijvingen/</a> : registreer je en bevestig dat je komt dit jaar.\n\nP.s: wij hebben <strong>ALTIJD</strong> plaats voor<strong> ELK KIND!</strong> Of je nu uit Gent komt of niet, geregistreerd bent of niet... maakt niet uit, ieder kind heeft bij ons een plaatsje vanaf 3 tem 15 jaar!\n\n</div>\n</div>\n</div>\n</div>\n&nbsp;\n\n<strong>Extra Nieuws!</strong>\n<div class=\"_1dwg _1w_m _2ph_\">\n<div id=\"js_qk\" class=\"_5pbx userContent\">\n<div id=\"id_5878d1e28c7b95795871564\" class=\"text_exposed_root text_exposed\">\n\n\'t Speelakkertje wil iedereen die vanaf dit jaar <strong>15 wordt</strong> de kans geven om van het <strong>speelpleinleven</strong> te proeven. Wil je graag plezier maken met kinderen, door er in de zomer mee op avontuur te gaan? Dan kan je hulp-animator worden. Vanaf het jaar dat je 16 wordt kan je een echte animator worden door op animatorcursus te gaan! Meer weten? Contacteer ons gerust!\n\nWij moedigen al onze animatoren sterk aan om op cursus te gaan met de VDS, of met een andere organisatie. Voor de kwaliteiten te verbeten van ons plein en de animator zelf.\n\nZin om op cursus te gaan? Zeker doen! En als je wil, kan je bij ons stage doen deze zomer! <span class=\"_47e3 _5mfr\" title=\"wink emoticon\"><img class=\"img\" src=\"https://www.facebook.com/images/emoji.php/v6/ff6/2/16/1f609.png\" alt=\"\" width=\"16\" height=\"16\" /></span>\n\n</div>\n</div>\n</div>\n<div></div>', 'INSCHRIJVINGEN ZOMER \'t Speelakkertje: START', '', 'inherit', 'closed', 'closed', '', '665-autosave-v1', '', '', '2017-01-29 14:56:55', '2017-01-29 13:56:55', '', 665, 'http://speelakkertje.be/665-autosave-v1/', 0, 'revision', '', 0),
(685, 10, '2017-01-29 14:57:11', '2017-01-29 13:57:11', '<div class=\"_1dwg _1w_m _2ph_\">\r\n<div id=\"js_qk\" class=\"_5pbx userContent\">\r\n<div id=\"id_5878d1e28c7b95795871564\" class=\"text_exposed_root text_exposed\">\r\n\r\nLieve mama\'s, papa\'s, speelvogels en sympathisanten <img class=\"img\" src=\"https://www.facebook.com/images/emoji.php/v6/ff0/2/16/1f603.png\" alt=\"\" width=\"16\" height=\"16\" /> <img class=\"img\" src=\"https://www.facebook.com/images/emoji.php/v6/ff0/2/16/1f603.png\" alt=\"\" width=\"16\" height=\"16\" />\r\n\r\nJe kan je vanaf <strong>nu</strong> registreren of <strong>inschrijven</strong> voor het speelplein, dit doe je zo:\r\n<div class=\"text_exposed_show\">\r\n\r\n1. Je hebt al een account aangemaakt voor je kinderen via <a href=\"http://speelakkertje.be/info-inschrijvingen/\" target=\"_blank\" rel=\"nofollow\">http://speelakkertje.be/info-inschrijvingen/</a> ? Je kan via je account <strong>HERBEVESTIGEN</strong> dat je komt in 2017 of je gegevens aanpassen indien nodig.\r\n\r\n2. Je hebt nog geen account? Maak dit dan aan via <a href=\"http://speelakkertje.be/info-inschrijvingen/\" target=\"_blank\" rel=\"nofollow\">http://speelakkertje.be/info-inschrijvingen/</a> : registreer je en bevestig dat je komt dit jaar.\r\n\r\nP.s: wij hebben <strong>ALTIJD</strong> plaats voor<strong> ELK KIND!</strong> Of je nu uit Gent komt of niet, geregistreerd bent of niet... maakt niet uit, ieder kind heeft bij ons een plaatsje vanaf 3 tem 15 jaar!\r\n\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n&nbsp;\r\n\r\n<strong>Extra Nieuws!</strong>\r\n<div class=\"_1dwg _1w_m _2ph_\">\r\n<div id=\"js_qk\" class=\"_5pbx userContent\">\r\n<div id=\"id_5878d1e28c7b95795871564\" class=\"text_exposed_root text_exposed\">\r\n\r\n\'t Speelakkertje wil iedereen die vanaf dit jaar <strong>15 wordt</strong> de kans geven om van het <strong>speelpleinleven</strong> te proeven. Wil je graag plezier maken met kinderen, door er in de zomer mee op avontuur te gaan? Dan kan je hulp-animator worden. Vanaf het jaar dat je 16 wordt kan je een echte animator worden door op animatorcursus te gaan! Meer weten? Contacteer ons gerust!\r\n\r\nWij moedigen al onze animatoren sterk aan om op cursus te gaan met de VDS, of met een andere organisatie. Voor de kwaliteiten te verbeteren van ons plein en de animator zelf.\r\n\r\nZin om op cursus te gaan? Zeker doen! En als je wil, kan je bij ons stage doen deze zomer! <span class=\"_47e3 _5mfr\" title=\"wink emoticon\"><img class=\"img\" src=\"https://www.facebook.com/images/emoji.php/v6/ff6/2/16/1f609.png\" alt=\"\" width=\"16\" height=\"16\" /></span>\r\n\r\n</div>\r\n</div>\r\n</div>\r\n<div></div>', 'INSCHRIJVINGEN ZOMER \'t Speelakkertje: START', '', 'inherit', 'closed', 'closed', '', '665-revision-v1', '', '', '2017-01-29 14:57:11', '2017-01-29 13:57:11', '', 665, 'http://speelakkertje.be/665-revision-v1/', 0, 'revision', '', 0),
(686, 10, '2017-01-29 14:58:44', '2017-01-29 13:58:44', '<div id=\"column_right\" style=\"width: 30%;float: right;padding: 5%\">\r\n<div class=\"side_menu\">\r\n<h2>Praktische informatie</h2>\r\n<ul>\r\n 	<li><a href=\"http://speelakkertje.be/onze-visie/\">Onze visie</a></li>\r\n 	<li><a href=\"http://speelakkertje.be/onze-werking/\">Onze werking</a></li>\r\n 	<li><a href=\"http://speelakkertje.be/een-speelpleindag/\">Een speelpleindag</a></li>\r\n 	<li><a href=\"http://speelakkertje.be/kledij/\">Kledij</a></li>\r\n 	<li><a href=\"http://speelakkertje.be/animatorenploeg/\">De animatorenploeg</a></li>\r\n 	<li><a href=\"http://speelakkertje.be/animator-worden/\">Animator worden</a></li>\r\n 	<li><a href=\"http://speelakkertje.be/de-staf/\">onze staf</a></li>\r\n 	<li><a href=\"http://speelakkertje.be/wie-is-wie/\">wie is wie</a></li>\r\n</ul>\r\n</div>\r\n</div>\r\n<div id=\"main_left\">\r\n<h1>Praktisch</h1>\r\nWe zijn een toffe groep van ongeveer 45 enthousiaste animatoren die al negentien jaar lang de kinderen in en rond Oostakker ongelofelijk veel speelplezier bieden tijdens de zomervakantie!  Met een gemiddelde opkomst van zo’n 120 pagadders per dag zijn we een van de grootste, (en ongetwijfeld één van de leukste) speelpleinwerkingen in Gent!\r\n\r\nJe vindt ons op de terreinen van <strong>EDUGO campus De Toren</strong>, <span style=\"text-decoration: underline\">Sint-Jozefstraat 10 in Oostakker</span>.  De ingang van het speelplein vind je achter de glazen deur, bereikbaar langs de dreef met kiezelsteentjes.\r\n\r\nAls je met de fiets naar het plein komt, is er ook een fietsenstalling voorzien speciaal voor jullie. Jullie kunnen daar de fietsen plaatsen en tijdens het speelplein gaat de stalling op slot om diefstal te voorkomen.\r\n\r\n[caption id=\"attachment_400\" align=\"alignleft\" width=\"300\"]<img class=\"wp-image-400 size-medium\" src=\"http://beta.speelakkertje.be/wordpress/wp-content/uploads/2016/07/Toren-300x200.jpg\" alt=\"Toren\" width=\"300\" height=\"200\" /> Bron: http://cms.edugo.be/[/caption]\r\n\r\n</div>', 'Praktisch', '', 'inherit', 'closed', 'closed', '', '110-revision-v1', '', '', '2017-01-29 14:58:44', '2017-01-29 13:58:44', '', 110, 'http://speelakkertje.be/110-revision-v1/', 0, 'revision', '', 0),
